(13, 'Sharjah', 'is gothic grandeur by the river', '<h4 class=\"font-size-21 font-weight-semi-bold text-gray-6 pb-1\">Time Travel</h4>\r\n<p>Immersed in history, London\'s rich seams of eye-opening antiquity are everywhere. The city\'s buildings are striking milestones in a unique and beguiling biography, and a great many of them &ndash; the Tower of London, Westminster Abbey, Big Ben &ndash; are instantly recognisable landmarks. There&rsquo;s more than enough innovation (the Shard, the Tate Modern extension, the Sky Garden) to put a crackle in the air, but it never drowns out London&rsquo;s seasoned, centuries-old narrative. Architectural grandeur rises up all around you in the West End, ancient remains dot the City and charming pubs punctuate the historic quarters, leafy suburbs and river banks. Take your pick.</p>\r\n<p>Once inside the historic palace located on the Right Bank of the Seine, see unmissable and iconic sights such as the Mona Lisa and Venus de Milo. Discover masterpieces of the Renaissance and ancient Egyptian relics, along with paintings from the 13th to 20th centuries, prints from the Royal Collection, and much more.</p>', 'sharjah', 201, '48.856613', '2.352222', 12, 'publish', 1, 2, NULL, 1, 1, NULL, NULL, NULL, '2022-04-05 06:31:49', '2022-05-24 15:42:14', 232, '\"\"');
