(17, 'Museum Of The Future', 'museum-of-the-future', '<table style=\"width: 892px;\" border=\"0\" width=\"600\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"height: 180.0pt;\">\r\n<td class=\"xl65\" style=\"height: 180pt; width: 877.219px;\" height=\"240\">&nbsp;The Museum of the Future is a living, breathing example of how technology, design, and humanity can come together to create an experience that\'s truly immersive.<br /><br />This museum is designed to teach visitors about the future by providing them with experiences they won\'t find anywhere else. Visitors are encouraged to interact with all aspects of the environment, whether it\'s through touch-screens or robotics.<br /><br />The exhibits are based on themes like \"home\" and \"education.\" The museum also features a showroom where visitors can take home some of the most innovative products on the market today.<br /><br />So what are you waiting for? Visit today !</td>\r\n</tr>\r\n</tbody>\r\n</table>', 883, 712, NULL, 1, 11, 'Sheikh Zayed Road Dubai', NULL, NULL, 8, 1, '261,262,263,', NULL, '245.00', '145.00', 2, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-13 00:57:11', '2022-05-26 21:53:52', 1, '[{\"title\":\"Entry in the Museum of the Future\"},{\"title\":\"Access to all floors ( Except 6th Floor)\"}]', '[{\"title\":\"Additional Services\"},{\"title\":\"Insurance\"},{\"title\":\"Drink\"},{\"title\":\"Tickets\"}]', NULL, NULL, NULL, '20/05/2022', NULL, NULL, 1, NULL, NULL, NULL, 1),
(18, 'Burj Khalifa - 124th Floor & 125th Floor', 'burj-khalifa-124th-floor-125th-floor', '<p>The Burj Khalifa is the tallest building in Dubai and the world. At 2,722 feet, it\'s also the tallest man-made structure ever built. The views from up there are so amazing that they\'re even visible from space!</p>\r\n<p>Visiting the Burj Khalifa is a great way to see Dubai from a new perspective and get some incredible photos out of it. Whether you\'re going solo or with friends and family, this experience is one you won\'t soon forget.</p>\r\n<p>The observation deck at Burj Khalifa offers 360-degree views of Dubai and surrounding areas including the Arabian Gulf coast and desert landscape beyond.&nbsp;</p>', 924, 505, NULL, 1, 11, '1 Sheikh Mohammed bin Rashid Blvd - Downtown Dubai - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '501,502,503,504,505,', NULL, '500.00', '245.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-14 07:31:43', '2022-05-26 22:22:49', 1, '[{\"title\":\"Entrance ticket at the selected time\"},{\"title\":\"Use of viewing telescope\"},{\"title\":\"Wifi throughout the attraction\"}]', '[{\"title\":\"Audio Guide\"},{\"title\":\"Entry to 148th Floor\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, 1),
(19, 'Burj Al Arab Hotel Tour', 'burj-al-arab', '<p><span style=\"color: #202124; font-family: arial, sans-serif; font-size: 16px; background-color: #ffffff;\">Burj Al Arab&nbsp;</span>stands on an artificial island that is 280 m (920 ft) from Jumeirah Beach and is connected to the mainland by a private curving bridge</p>\r\n<p>Important information</p>\r\n<p>Bring Passport/ Emirates ID</p>\r\n<p>The booking confirmation is valid only for the specific date and time shown and shall automatically expire upon the lapse of specific date and time&nbsp;</p>', 923, 771, NULL, 1, 11, 'Umm Suqeim 3 - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '557,560,561,', NULL, '799.00', '599.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-14 07:54:15', '2022-05-26 22:19:19', 1, '[{\"title\":\"Burj Al Arab Tour\"},{\"title\":\"2 Course set menu for lunch\"}]', '[{\"title\":\"Additional Services\"},{\"title\":\"Insurance\"},{\"title\":\"Drink\"},{\"title\":\"Tickets\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
(20, 'Luxury Limousine', 'luxury-limousine', '<p>Private luxury limousine, comfortable transportation&nbsp;</p>', 922, 703, NULL, 1, 11, NULL, NULL, NULL, 8, NULL, '703,702,', NULL, '1000.00', '750.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-14 07:56:54', '2022-05-26 22:21:49', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
(21, 'Abu Dhabi Skydive', 'abu-dhabi-skydive', '<p>Enjoy the thrill experience unlike any other. Jump from 13000 feet and enjoy the view of abu dhabi from the top</p>', 921, 474, NULL, 1, 12, NULL, NULL, NULL, 8, NULL, '474,', NULL, '1500.00', '1300.00', 12, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-14 08:12:28', '2022-05-26 22:21:41', 0, '[{\"title\":\"Tandem skydive instructor\"},{\"title\":\"Enjoy a 4-5 minute descent view the beauty of Abu Dhabi\"}]', NULL, '[{\"image_id\":null,\"title\":\"What To Bring\",\"desc\":null,\"content\":\"Lace-up Shoes\\r\\nPhoto Id\\r\\nPassport Or Emirates Id\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1),
(22, 'Hot Air Balloon', 'hot-air-balloon', '<p>Enjoy the unforgottable experience and see the breathtaking view from top.</p>', 920, 665, NULL, 1, 11, NULL, NULL, NULL, 8, NULL, '665,664,', NULL, '1100.00', '800.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-14 08:20:23', '2022-05-26 22:21:31', 0, '[{\"title\":null}]', '[{\"title\":\"Video recording sent via email @ 200 AED\"},{\"title\":\"Event Banner on basket per flight @ 250 AED\"},{\"title\":\"Banner need to be provided by client\"},{\"title\":\"Private transportation on request from all over United Arab Emirates\"}]', '[{\"image_id\":null,\"title\":null,\"desc\":null,\"content\":null}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 2),
(23, 'Dubai Safari Park', 'dinner-in-the-sky', '<table style=\"width: 890px;\" border=\"0\" width=\"600\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"height: 150pt;\">\r\n<td class=\"xl65\" style=\"height: 150pt; width: 875.219px;\" height=\"200\">If you love animals and are looking for an amazing experience, then you need to visit Dubai Safari Park. It is located in the desert and it is not far from the city center.<br /><br />This park is home to more than 2,000 animals including lions, tigers, giraffes, elephants, camels and many more. These animals freely roam around their enclosures and visitors can watch them from a safe distance. The park also has other attractions such as a water park and children\'s play area. You will also find restaurants where you can eat while enjoying the views of these wonderful creatures. There are several packages available when visiting this park including entrance tickets and lunch/dinner at one of their restaurants (which may be included in your package).</td>\r\n</tr>\r\n</tbody>\r\n</table>', 919, 628, NULL, 1, 11, NULL, NULL, NULL, 8, NULL, '628,626,', NULL, '150.00', '50.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-14 08:29:13', '2022-05-26 22:21:15', 0, '[{\"title\":\"Entry info Dubai Safari Park\"},{\"title\":\"African Village\"},{\"title\":\"Explorer Village\"},{\"title\":\"Asian VIllage includes bird show\"},{\"title\":\"Kids Farm\"},{\"title\":\"Wadi\"},{\"title\":\"Bird Show, Giraffe Feeding and Hippo Aquarium\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1),
(24, 'Yatch Ride', 'fishing-trip', '<table style=\"width: 450pt;\" border=\"0\" width=\"600\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr style=\"height: 128.1pt;\">\r\n<td class=\"xl64\" style=\"height: 128.1pt; width: 450pt;\" width=\"600\" height=\"170\">A Yacht ride is an amazing experience that will leave you wanting more. You get to enjoy the beauty of Dubai as you cruise along the water, while enjoying drinks and snacks while relaxing on deck.<br />This is a great opportunity to experience the sights and sounds of one of the most luxurious cities in the world while taking in its rich history and culture. You can also explore some of its most incredible beaches while enjoying all the comforts of home on board one of our yachts.<br />The yachts are designed with comfort in mind, so you can take it easy and enjoy your time on the water.&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>', 918, 727, NULL, 1, 11, 'Marina/ Jumeirah', NULL, NULL, 8, NULL, '497,494,', NULL, '500.00', '425.00', 4, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-20 19:46:23', '2022-05-26 22:12:52', 1, '[{\"title\":\"Professional Crew\"},{\"title\":\"1 Hour Cruising in Marina Lagoon\"},{\"title\":\"Life Jacket\"},{\"title\":\"Refreshments ( Water & Soft Drinks)\"}]', '[{\"title\":null}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1),
(25, 'Miracle Garden', 'dinner-in-the-sky-1', '<p>The Miracle Garden in Dubai is an oasis of flowers, plants, and trees. With over 30,000 species of plants, it\'s the largest botanical garden in the world.</p>\r\n<p>If you\'re looking for a place to relax and unwind with your family or friends, the Miracle Garden is just what you need! You can take a walk through the gardens and enjoy the beautiful views while learning more about each type of plant that grows there. The garden also has a number of restaurants and cafes where you can stop for lunch or dinner after exploring all that it has to offer.</p>', 917, 706, NULL, 1, 11, 'Al Barsha South 3, Dubailand, Dubai, UAE', NULL, NULL, 8, NULL, '713,706,705,704,', NULL, '55.00', '55.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-20 20:10:28', '2022-05-26 22:10:33', 0, '[{\"title\":\"Entrance Ticket to Miracle Garden\"},{\"title\":\"A Panoramic View of more than 45 Million flowers\"}]', NULL, '[{\"image_id\":null,\"title\":\"Address\",\"desc\":null,\"content\":\"Al Barsha South 3, Dubailand, Dubai, UAE\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(26, 'Deep Sea Fishing', 'deep-sea-fishing', '<p>Fishing trips in Dubai are the ideal way to spend time with friends and family. Whether you\'re an experienced angler or a novice, we can cater to your needs and help you find the perfect day out.</p>\r\n<p>The city boasts some of the best fishing spots in the world, including the Aspire Park, where you can get your hands on a variety of fish. There\'s also the Dubai Creek, which is home to some of the most exciting freshwater fishing opportunities on offer.</p>\r\n<p>If you\'ve never tried this before but still want to give it a go on your next trip to Dubai, then why not consider booking a guided tour? This will allow you to learn more about what goes into catching different species of fish as well as how best to prepare them for cooking afterwards!</p>', 916, 789, NULL, 6, 11, 'Marina/JBR', NULL, NULL, 8, NULL, '789,787,', NULL, '1600.00', '1408.00', 4, 1, 100, '[{\"title\":\"Important Information\",\"content\":\"Please carry valid ID proof\\/Passport or Emirates ID it is mandatory during the trip.\\r\\nPlease wear lightweight summer clothing\\r\\nThis Operation of this activity also depends on the weather conditions.\\r\\nAny extra services will be arranged with an additional charge.\\r\\nChosen date and time are subject to availability.\\r\\nThe service provider holds no responsibility if any component of an attraction is non-operational due to technical reasons or weather conditions.\\r\\nThere will be no refund for partly utilized services and in case if the guest doesn\\u2019t show up at the start time mentioned in the tour itinerary, the service provider reserves the right to charge 100% no-show fee.\"}]', 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 19:03:43', '2022-05-26 22:10:10', 1, '[{\"title\":\"Refreshments (Water and Soft Drinks)\"},{\"title\":\"All fishing equipment will be provided\"},{\"title\":\"Instructions by Professionals\"}]', NULL, '[{\"image_id\":null,\"title\":\"Cancellation\",\"desc\":null,\"content\":\"Free Cancellation 24 Hours prior\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(27, 'Dinner in the Sky', 'dinner-in-the-sky-2', '<p>Looking for a night to remember?</p>\r\n<p>The Dinner in Sky in Dubai is the perfect way to make a spectacular evening even more memorable. Located on the 124th floor of the world\'s tallest building, Burj Khalifa, you\'ll be treated to a four-course meal with a glass of champagne and live piano music. And there\'s more! You\'ll also get to enjoy a view that includes the Burj Al Arab, Palm Jumeirah and more. If you want to make it even more special, add on an after-dinner dance with one of our professional dancers or a photo shoot with your loved one.</p>\r\n<p>If you\'re ready to take your date night (or anniversary) to new heights, book now!</p>', 915, 803, NULL, 1, 11, 'Al Sufoh - Skydive - Al Seyahi St - Dubai - United Arab Emirates.', NULL, NULL, 8, NULL, '803,337,', NULL, '700.00', '615.00', 2, 1, 100, '[{\"title\":\"Pick Up & Drop\",\"content\":\"Pick Up & Drop Facilities are arranged on request\"},{\"title\":\"Important Information\",\"content\":\"Please arrive at the venue at least 20 minutes before the selected time slot.\\r\\nPlease dress according to the weather.\\r\\nPregnant women are not allowed to experience Dinner in the Sky.\\r\\nA person under 14 may participate if accompanied by an adult or at least 110 cm tall.\\r\\nA person must be with a maximum weight of 150 kg of weight to enjoy the Dinner in The Sky.\\r\\nPlease avoid wearing open shoes or shoes without laces at the time of the experience.\\r\\nA person under the influence of alcohol or drugs is not allowed.\\r\\nSmoking is strictly prohibited during the Dinner in the Sky experience.\"}]', 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 19:17:39', '2022-05-26 22:09:43', 1, '[{\"title\":\"Dinner in the sky entry tickets\"},{\"title\":\"The aerial culinary experience at a height of over 50 meters\"},{\"title\":\"Multi-Course Lunch & Dinner\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(28, 'Dubai Dolphin Show', 'dubai-dolphin-show', '<p>If you\'re looking for a fun, unique experience in Dubai, look no further than the Dubai Dolphin Show!</p>\r\n<p>The show features dolphins and sea lions performing tricks, dancing, and playing games with spectators. It\'s a great way to spend time with your family or friends while learning about these amazing animals.</p>\r\n<p>The Dubai Dolphin Show is open daily from 10:30am-5pm, with extended hours during the summer months. Tickets can be purchased online or at the door on the day of your visit.</p>', 914, 350, NULL, NULL, 11, 'Dubai Dolphinarium, Inside the Creek Park Gate 1, Umm Hurair 2 - Dubai.', NULL, NULL, 8, NULL, '812,810,808,350,', NULL, '105.00', '89.00', NULL, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 19:34:11', '2022-05-26 22:09:15', 1, '[{\"title\":\"Admission ticket to Dolphin Live Show\"},{\"title\":\"Access to up-to-date marine mammal facility\"},{\"title\":\"All age group\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(29, 'Sky View Dubai', 'sky-view-dubai', '<p>Are you ready to take in the view?</p>\r\n<p>Sky View Dubai is the world\'s tallest outdoor observation deck, and it\'s located in the heart of Dubai. It\'s a great place to go if you want to get a panoramic view of the city, and definitely worth checking out if you\'re planning a trip there.</p>\r\n<p>If you\'re looking for something that will give you a different perspective on Dubai, Sky View is perfect! It offers 360-degree views from its observation deck, so no matter where you stand on the tower, there\'s always more than enough to see.</p>', 913, 477, NULL, 1, 11, 'Emaar Square Area, Downtown Dubai 111969 - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '477,473,', NULL, '70.00', '60.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 19:42:07', '2022-05-26 22:08:50', 1, '[{\"title\":\"Sky Views Dubai Entry Ticket\"},{\"title\":\"Access to the Sky Observatory and Sky Glass Slide experience\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(30, 'View at the palm', 'view-at-the-palm', '<p>\"Dazzling is the only word to describe the sights of Palm Jumeirah Dubai. It is a man-made island built in Dubai, United Arab Emirates. The island has been designed to resemble a palm tree and is the world\'s largest man-made island.\"</p>\r\n<p>It was developed by Nakheel Properties and is part of an area called Jumeirah, which is itself an extension of Dubai. The total cost of construction was estimated at $10 billion, but it\'s not just expensive&mdash;it\'s also one of the most ambitious projects ever attempted: there are three man-made islands in all, each shaped like a palm tree.</p>\r\n<p>The Palm is home to some of the most luxurious hotels in the world, including Atlantis The Palm and Conrad Dubai. You can also find shops, restaurants and attractions here; it\'s one of Dubai\'s biggest tourist attractions.</p>', 912, 482, NULL, 1, 11, 'The Palm Jumeirah - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '841,482,', NULL, '100.00', '100.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 20:09:31', '2022-05-26 22:08:25', 1, '[{\"title\":\"Admission to The View at The Palm Jumeirah Dubai at Palm Tower\"},{\"title\":\"Marvelous 360 degree full display of the legendary Palm Jumeirah, Arabian Gulf and beyond\"},{\"title\":\"Get to know more about this fascinating island with its interactive theatre\"},{\"title\":\"Swift elevator ride offering floor-to-ceiling digital experience\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(31, 'Dubai Frame', 'dubai-frame', '<p>You\'ve probably heard of Dubai as a place of opulence and luxury, but what you might not know is that there\'s more than just shopping on offer here. Dubai Frame is an incredible attraction that will give you a new perspective on this fascinating city. It\'s located at the center of the city, so it\'s easy to get to from anywhere in town.&nbsp;</p>\r\n<p>The Dubai frame is a work of art. It\'s got a bold, modern design that will look great in your home, and it also has a lot to say about the city of Dubai.</p>\r\n<p>If you\'re looking for a beautiful way to display your favorite photos from your travels around this fascinating country, this frame is just what you need.</p>', 911, 615, NULL, 1, 11, 'Zabeel Park Jogging Track - Za\'abeel - Al Kifaf - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '821,817,', NULL, '52.00', '49.00', 2, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 20:17:17', '2022-05-26 22:07:55', 1, '[{\"title\":\"Admission ticket to the spectacular Dubai Frame\"},{\"title\":\"Step back in time at Dubai Past Gallery\"},{\"title\":\"Enjoy 360 degree views of Old and New Dubai from 150-meter high Sky Deck\"},{\"title\":\"Walk over the breathtaking Glass Bridge\"},{\"title\":\"Glance into Dubai\\u2019s imposing future with Virtual Metropolis experience\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(32, 'Yas Water world', 'yas-water-world', '<p>A water park is a place where you can have fun and enjoy the day. It is a place where you can forget all your worries and spend quality time with your family or friends. Yas Waterworld is one such place where you can have fun, relax and enjoy your day with family and friends.</p>\r\n<p>Yas Waterworld is located in Abu Dhabi near Al Raha Beach, it was opened in 2009 and has become one of the most popular water parks in Abu Dhabi. The park features several attractions including;</p>\r\n<p>-A wave pool</p>\r\n<p>-A lazy river ride</p>\r\n<p>-A surf simulator ride (with actual waves)</p>\r\n<p>-A kiddie area for kids under 5 years old</p>\r\n<p>-Fountain shows every hour on the hour from 4pm until 10pm</p>\r\n<p>The park also has restaurants, cafes, shops and parking areas available on site for guests who want to make a full day out of their visit to Yas Waterworld.</p>', 910, 840, NULL, 1, 12, 'Yas Waterworld - Abu Dhabi - United Arab Emirates.', NULL, NULL, 8, NULL, '840,839,838,837,493,', NULL, '270.00', '270.00', 8, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 20:26:02', '2022-06-21 12:47:01', 1, '[{\"title\":\"Yas Water World Ticket\"},{\"title\":\"All Rides\"},{\"title\":\"If you doesn\'t want to wait in the queue to get your turn for rides please book the premium tickets\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(33, 'Warner Bros World', 'warner-bros-world', '<p>Warner Bros World Abu Dhabi is the ultimate family entertainment destination.</p>\r\n<p>Imagine a day at the park with your family, where you can enjoy all the rides and attractions that you love. Now imagine that same day, but better.</p>\r\n<p>Warner Bros World Abu Dhabi is an immersive theme park experience that takes you on rides and attractions in the worlds of Warner Bros\' most beloved franchises, including DC Comics and Looney Tunes, as well as new experiences created exclusively for this park.</p>\r\n<p>With so many rides to choose from, it can be hard to pick just one&mdash;but we have some suggestions! If you\'re looking for something exciting, try The Dark Knight: The Ride&mdash;a roller coaster that takes you through the streets of Gotham City at breakneck speeds. Or if your heart belongs to Bugs Bunny and his Looney Tunes friends, hop on Marvin\'s Marvelous Mechanical Museum for a ride through some of their most famous scenes.</p>', 909, 486, NULL, 1, 12, 'Yas Island - Abu Dhabi - United Arab Emirates', NULL, NULL, 8, NULL, '487,486,485,484,', NULL, '295.00', '295.00', 10, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 20:30:50', '2022-05-26 22:06:43', 1, '[{\"title\":\"Admission to the region\\u2019s first of its kind Warner Bros Theme Park\"},{\"title\":\"Gain access to its six fascinating lands dedicated to your favorite comic characters\"},{\"title\":\"Enjoy 29 rides including 4D and 5D superhero rides, plus a myriad of imposing attractions and shows\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(34, 'IMG World of Adventure', 'img', '<p>IMG Worlds of Adventure is a theme park that is like no other. It has been designed to be the world\'s biggest indoor theme park and it features an amazing variety of rides, attractions, restaurants and shops.</p>\r\n<p>If you haven\'t yet visited IMG Worlds of Adventure dubai then you really should! There\'s something for everyone at this incredible venue, from thrill seekers to those who prefer to take it easy.</p>\r\n<p>The park is home to over 40 world-class rides and attractions including the fastest launched coaster in the world (X-Sector), a state-of-the-art 4D cinema (IMAX&reg;) and an eye-catching rollercoaster that takes riders through a beautiful rainforest (Amazonia).</p>\r\n<p>There\'s also plenty of food options available too &ndash; from traditional Arabic cuisine to American favourites such as burgers and fries! If you\'re shopping for souvenirs then don\'t worry &ndash; there are plenty of shops on site too so you can pick up some gifts while you\'re there.</p>', 908, 672, NULL, 1, 11, 'IMG Worlds of Adventure, E311, Sheikh Mohammed Bin Zayed Road, City of Arabia - Dubai.', NULL, NULL, 8, NULL, '680,673,672,668,', NULL, '335.00', '335.00', 8, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 20:35:01', '2022-05-26 22:06:08', 1, '[{\"title\":\"Gain entry to one of the world\\u2019s biggest indoor theme parks\"},{\"title\":\"Unlimited access to its four amazing zones including the Dinosaur exclusive zone\"},{\"title\":\"Enjoy rides, roller coasters and experience other attractions themed around your favorite cartoon characters and superheroes\"},{\"title\":\"See live entertainment shows\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(35, 'Atlantis Aquaventure Waterpark', 'atlantis-aquaventure-waterpark', '<p>Aquaventure Waterpark Dubai is a water park situated in the middle of the desert. It\'s a great place to visit if you\'re looking for some fun times with your friends or family, and it\'s also a good option if you want to beat the heat during summer.</p>\r\n<p>The water park features many different rides, including a wave pool and lazy river. There are also many dining options available at Aquaventure Waterpark Dubai such as Burger Lab and The Grill. You can even take a break from all the fun by visiting one of the two hotels located on site: Atlantis The Palm or Jumeirah Beach Hotel!</p>\r\n<p>Aquaventure Waterpark Dubai has something for everyone, so grab your swimsuits and get ready for an adventure!</p>', 907, NULL, NULL, 1, 11, 'The Crescent, Palm Island, Dubai, United Arab Emirates', NULL, NULL, 8, NULL, '544,754,753,', NULL, '299.00', '299.00', NULL, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 20:40:18', '2022-05-26 22:05:47', 1, '[{\"title\":\"Atlantis Aquaventure Day Pass\"},{\"title\":\"Enjoy unlimited access to Aquaventure Water Park\"},{\"title\":\"Get unlimited access to Adventure Beach\"},{\"title\":\"Atlantis Aquaventure Combo\"},{\"title\":\"Make the most of its mix of heart-racing, milder, and kid-specific rides  with Entry to the Lost Chambers Aquarium\"},{\"title\":\"Lost Chamber Aquarium\"},{\"title\":\"See over 65000 distinct marine animals\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(36, 'Wild Wadi Waterpark', 'wild-wadi-waterpark', '<p>Wild Wadi Waterpark Dubai is the ultimate adventure.</p>\r\n<p>Tucked away in the heart of the city, this water park offers an action-packed day out for the whole family. Whether you&rsquo;re looking for a thrilling ride or a relaxing dip, Wild Wadi has something for everyone.</p>\r\n<p>Wild Wadi Waterpark Dubai has more than 30 rides, including water slides, wave pools and lazy rivers. There are also activities like archery and mini golf to keep you busy between rides.</p>\r\n<p>If you want to relax in the sun, there are plenty of shaded areas where you can just kick back and unwind.</p>', 906, 488, NULL, 1, 11, 'Wild Wadi Water Park, Jumeirah Road, Next To Jumeirah Beach Hotel - Dubai.', NULL, NULL, 8, NULL, '488,', NULL, '330.00', '259.00', 8, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 20:45:30', '2022-05-26 22:05:19', 1, '[{\"title\":\"Admission ticket to Wild Wadi Water Park\"},{\"title\":\"Access to world\\u2019s fastest and tallest fun rides\"},{\"title\":\"Exciting rides suitable for all ages available\"},{\"title\":\"Food and beverage available in the premises\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(37, 'Motiongate Park', 'motiongate-park', '<p>Motiongate Park Dubai is a brand new theme park that\'s all about motion.</p>\r\n<p>Motiongate Park Dubai offers an immersive and interactive experience that you won\'t find anywhere else in the city. The park features rides and attractions based on some of your favorite movies and TV shows, as well as plenty of other surprises&mdash;like special effects, animatronics, and more&mdash;that will blow your mind.</p>\r\n<p>And the best part? It\'s not just for kids! They offer a wide range of experiences for all ages, from thrilling roller coasters to gentle boat rides through a magical underwater world.</p>\r\n<p>Visit Motiongate Park Dubai today!</p>', 905, 711, NULL, 1, 11, 'Sheikh Zayed Road, Opposite Palm Jebel Ali – Dubai', NULL, NULL, 8, NULL, '711,709,', NULL, '330.00', '295.00', 10, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 20:50:25', '2022-05-26 22:04:58', 1, '[{\"title\":\"Entry ticket to Motiongate Dubai\"},{\"title\":\"Access to all ride and attraction\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `bc_tours` (`id`, `title`, `slug`, `content`, `image_id`, `banner_image_id`, `short_desc`, `category_id`, `location_id`, `address`, `map_lat`, `map_lng`, `map_zoom`, `is_featured`, `gallery`, `video`, `price`, `sale_price`, `duration`, `min_people`, `max_people`, `faqs`, `status`, `publish_date`, `create_user`, `update_user`, `deleted_at`, `origin_id`, `lang`, `created_at`, `updated_at`, `default_state`, `include`, `exclude`, `itinerary`, `review_score`, `ical_import_url`, `date_form_to`, `min_age`, `pickup`, `wifi_available`, `enable_service_fee`, `service_fee`, `surrounding`, `min_day_before_booking`) VALUES
(38, 'Legoland Waterpark', 'legoland-waterpark', '<p>Legoland Waterpark Dubai is the perfect place for families to spend a fun-filled day together. Located on the edge of the world-famous Palm Jumeirah, you\'ll find yourself immersed in a world of action and adventure!</p>\r\n<p>Make sure you don\'t miss out on any of our fantastic rides, which include a crazy rollercoaster that takes you through the depths of space and back again, as well as an interactive pirate ship where you can use your imagination to bring your shipmates to life!</p>\r\n<p>We also offer a range of exciting activities that are perfect for all ages. Whether you want to learn how to surf with our professional instructors or just splash around in one of our many pools, we\'ve got something for everyone!</p>', 904, 699, NULL, 1, 11, 'Parks & Resorts - Sheikh Zayed Rd - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '700,699,697,695,', NULL, '330.00', '295.00', 7, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 20:54:42', '2022-05-26 22:04:35', 1, '[{\"title\":\"Entry ticket to Legoland Dubai\"},{\"title\":\"Access to all rides and attraction\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(39, 'Laguna Water Park', 'laguna-water-park', '<p>Laguna Water Park Dubai is a fun and exciting destination for families. With a variety of water rides and attractions, the park offers something for everyone, from children to adults.</p>\r\n<p>Laguna Water Park Dubai is located in the heart of Jumeirah Lake Towers, just five minutes from Dubai Mall and Burj Khalifa. The park has been designed to offer a range of experiences, with rides and attractions suitable for all ages. There are several pools, including an indoor wave pool, an outdoor splash pool, and a lazy river. There are also plenty of slides to choose from&mdash;including a high-speed slide that offers speeds of up to 60km/h!</p>\r\n<p>There are also fun activities available at Laguna Water Park Dubai. In addition to the slides, there is a lazy river ride through which you can relax while being carried around by an artificial current; there\'s also an outdoor pool with waterfalls and jets so you can relax while enjoying the view outdoors.</p>', 903, 692, NULL, 1, 11, 'La Mer - Jumeirah 1 - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '696,694,693,692,', NULL, '190.00', '171.00', 7, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 21:01:43', '2022-05-26 22:04:13', 1, '[{\"title\":\"Entry ticket to Laguna Water Park\"},{\"title\":\"Access of all rides, play areas and the beach\"},{\"title\":\"Enjoy many thrilling rides including the GCC\\u2019s first-of-its-kind surfing attraction\"},{\"title\":\"Unwind at its exclusive Relax zone\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(40, 'Jet Ski Dubai', 'jet-ski-dubai', '<p>There\'s nothing like taking a ride on the water, especially when you\'re doing it in style.</p>\r\n<p>At Jet Ski Dubai, we offer you the chance to take your next vacation on a jet ski. Our rental services are available for both individuals and groups, with a variety of options that will suit any budget. We also offer lessons to help you get the most out of your time on the water!</p>\r\n<p>Jet Ski Dubai is located right off the coast of Jumeirah Beach Residence (JBR), so you can enjoy some of Dubai\'s best beaches while you\'re out there having fun. Just make sure that you don\'t get too close to any other boats or swimmers&mdash;it wouldn\'t be good for anyone if someone got injured because of your carelessness!</p>', 902, 681, NULL, 1, 11, 'Jet Ski 30 / 60 Mins to indulge in water activities', NULL, NULL, 8, NULL, '682,681,', NULL, '360.00', '299.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 21:06:09', '2022-05-26 22:03:03', 1, '[{\"title\":\"Instructions by Professionals\"},{\"title\":\"Jet Ski 30 to indulge in water activities\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(41, 'Desert Safari', 'desert-safari', '<p>Desert Safari Dubai: The Ultimate Desert Experience</p>\r\n<p>Desert Safari Dubai is an epic journey into the desert, where you\'ll take in the incredible landscape on a camel and explore ancient cultures. The tour includes a 4WD off-road drive through the desert, as well as visits to Bedouin camps where you can enjoy traditional food and watch local dancers perform. You\'ll also get to see camels up close, learn about their history, and even ride one if you choose!</p>\r\n<p>This adventure is perfect for anyone interested in seeing more of Dubai than they thought possible&mdash;you\'ll get a chance to experience one of the world\'s most fascinating environments while getting up close with some of its most iconic animals!</p>\r\n<p>So why wait? Book your Desert Safari today!</p>', 901, 790, NULL, 3, 11, 'Al Aweer Desert Camp, Dubai, UAE', NULL, NULL, 8, NULL, '795,793,790,585,587,788,588,', NULL, '350.00', '191.00', 6, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 21:13:30', '2022-05-26 22:02:04', 1, '[{\"title\":\"Round trip hotel transfers by 4X4 Vehicle\"},{\"title\":\"Dune bash aboard a 4X4 Vehicle\"},{\"title\":\"Unlimited refreshments\"},{\"title\":\"Tanoura show by male artist\"},{\"title\":\"BBQ dinner with vegetarian and non-vegetarian dishes\"},{\"title\":\"Fire show\"},{\"title\":\"Belly dance\"},{\"title\":\"Camel Ride\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(42, 'Buggy Ride', 'buggy-ride', '<p>Buggy Ride Dubai is an exciting and thrilling activity that you can do with your loved ones. It is a great way to spend time with your family and friends, while getting the adrenaline rush that you need. You will get the opportunity to ride on a buggy at high speeds and experience the thrill of being in control of your own vehicle.</p>\r\n<p>The buggy rides are available at various locations in Dubai. The most popular location is the Jumeirah Beach Park, which has many attractions such as parks, gardens and restaurants. You can also choose to go on a buggy ride around other popular attractions like Burj Khalifa or Downtown Dubai.</p>\r\n<p>The Buggy Ride is perfect for any occasion or event such as birthdays, anniversaries or even corporate events. You can hire our buggies for up to 6 people at one time (minimum 3 people), which makes it ideal for families or groups of friends who want to enjoy this exciting activity together!</p>', 900, 765, NULL, NULL, 11, 'Al Aweer Desert camp, Dubai, UAE.', NULL, NULL, 8, NULL, '766,765,', NULL, '1596.00', '1277.00', 6, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 21:19:01', '2022-05-26 22:01:41', 0, '[{\"title\":\"60 minutes Dune Buggy Ride\"},{\"title\":\"60 minutes Quad Bike Ride\"},{\"title\":\"Access to an advanced yet safe and user-friendly dune buggy\"},{\"title\":\"A thrilling session of sandboarding included\"},{\"title\":\"A thrilling session of sandboarding included\"},{\"title\":\"Unlimited Refreshments\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(43, 'Al Ain City Tour', 'al-ain-city-tour', '<p>Visit Al Ain City Tour Dubai</p>\r\n<p>Al Ain City Tour Dubai is the best way to get to know the historical and cultural heritage of this beautiful city. The tour will take you through some of the most important landmarks in town, including Sheikh Zayed Grand Mosque, Sheikh Rashid Bin Saeed Al Maktoum House Museum, Al Ain National Museum and much more. You will also have the chance to visit Hili Archaeological Park, which is home to ancient petroglyphs dating back thousands of years.</p>\r\n<p>The tour includes a stop at Jebel Hafeet Mountain Resort for a visit to the famous Ski Slopes as well as lunch at one of the restaurants there. There are also several optional activities available during your stay such as camel riding or sand dune buggying!</p>', 899, 836, NULL, 1, 11, 'Al Ain City', NULL, NULL, 8, NULL, '836,833,831,', NULL, '862.00', '862.00', 8, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 21:28:36', '2022-05-26 22:01:23', 1, '[{\"title\":\"Pick up from your Hotel\"},{\"title\":\"Visit of Al Ain museum\"},{\"title\":\"Al Ain National Heritage\"},{\"title\":\"Al Ain Fort\"},{\"title\":\"Visit to Archaeological park\"},{\"title\":\"Jebel Hafeet mountain\"},{\"title\":\"Hot water springs\"},{\"title\":\"Al Ain zoo (entrance ticket not included)\"},{\"title\":\"Al Ain Mall\"},{\"title\":\"Drop off at your Hotel.\"}]', NULL, '[{\"image_id\":null,\"title\":\"Special Note\",\"desc\":null,\"content\":\"Al Ain National Heritage, Al Ain Fort and Archaeological Park will be closed on Monday\'s and Friday\'s\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(44, 'Dubai City Tour', 'dubai-city-tour', '<p>Dubai City Tour is a must-do activity while you\'re in Dubai.</p>\r\n<p>There\'s nothing quite like seeing the city from the top of the world\'s tallest building, and it\'s a great way to get a sense of what makes this place so special.</p>\r\n<p>Whether it\'s your first time in town or not, Dubai City Tour is a great way to get an overview of what the city has to offer. With this tour, you\'ll be able to see some of the most iconic landmarks in Dubai including Burj Khalifa and The Palm Jumeirah as well as lesser known locations that only locals know about!</p>\r\n<p>The tour also includes stops at some of Dubai&rsquo;s most popular attractions such as Atlantis The Palm Hotel &amp; Aquarium and Wild Wadi Water Park.</p>\r\n<p>If you\'re looking for an exciting and fun way to spend an afternoon with friends or family members then look no further than this exciting new tour!</p>', 898, NULL, NULL, 1, 11, 'Transfers are only provided from centrally located hotels and residences in Dubai city. (Deira, Bur Dubai, Sheikh Zayed, Marina)', NULL, NULL, 8, NULL, '806,809,807,806,', NULL, '125.00', '75.00', 4, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 21:38:43', '2022-05-26 22:01:05', 1, '[{\"title\":\"Pick up from your Hotel\"},{\"title\":\"Jumeirah Mosque \\u2013 a rare example of a mix of Islamic and modern architecture\"},{\"title\":\"Mall of Emirates \\u2013 with Ski Dubai and a host of shops, restaurants and caf\\u00e9 \\u2013 it provides finest in shopping, dining and entertainment activities\"},{\"title\":\"Mall of Emirates \\u2013 with Ski Dubai and a host of shops, restaurants and caf\\u00e9 \\u2013 it provides finest in shopping, dining and entertainment activities\"},{\"title\":\"Photoshop at Atlantis\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(45, 'Dubai Mall Aquarium', 'dubai-mall-aquirium', '<p>Want to spend some time getting away from it all?</p>\r\n<p>The Dubai Mall Aquirium is the perfect place to do just that. Located in a central location in the mall, this aquarium offers a beautiful escape from the hustle and bustle of everyday life.</p>\r\n<p>The aquarium features more than 80 species of fish including sharks and rays, as well as penguins. You can even see penguins swimming underwater!</p>\r\n<p>You\'ll find yourself mesmerized by the colorful coral reef at the center of the aquarium, which is home to over 1,000 species of fish. The aquarium also features an underwater tunnel where you can get up close and personal with some of your favorite sea creatures.</p>\r\n<p>This is truly one of Dubai\'s hidden gems &mdash; so come on down and take a break from reality!&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>', 897, 826, NULL, 1, 11, 'Dubai Mall', NULL, NULL, 8, NULL, '830,829,828,827,', NULL, '174.00', '106.00', 5, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 21:56:51', '2022-05-26 22:00:46', 1, '[{\"title\":\"Dubai Mall Aquarium Tickets\"},{\"title\":\"A view of Underwater Zoo Aquarium\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(46, 'Atlantas Water Park', 'atlantas-water-park', '<p>Atlantas water park Dubai is the perfect place for a day out with friends and family. With more than 40 slides and attractions, you can spend hours playing in the water and having fun.</p>\r\n<p>If you\'re looking for something really exciting, try the Insanity slide. It\'s one of the highest in the world and will give you a rush as you plummet down at speeds of up to 85kph! If that\'s not enough excitement for you, try the Tornado which spins riders around as they fall.</p>\r\n<p>There are also some quieter rides if you want to take a break from all the excitement of being on a water slide. The wave pool is great fun too because it lets you experience what it feels like when waves crash over your head while sitting perfectly still on dry land.</p>\r\n<p>Atlantas water park Dubai has something for everyone including an edutainment area where children can learn about animals such as sharks or dolphins through interactive games and activities. There are also restaurants where you can enjoy a tasty meal after spending all day enjoying yourself at Atlantas water park Dubai!</p>', 896, 753, NULL, 1, 11, 'The Crescent, Palm Island, Dubai, United Arab Emirates', NULL, NULL, 8, NULL, '555,544,', NULL, '299.00', '299.00', NULL, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 22:02:51', '2022-05-26 22:00:28', 1, '[{\"title\":\"Atlantis Aquaventure Day Pass\"},{\"title\":\"Enjoy unlimited access to Aquaventure Water Park\"},{\"title\":\"Get unlimited access to Adventure Beach\"},{\"title\":\"Atlantis Aquaventure Combo\"},{\"title\":\"Make the most of its mix of heart-racing, milder, and kid-specific rides  with Entry to the Lost Chambers Aquarium\"},{\"title\":\"Lost Chamber Aquarium\"},{\"title\":\"See over 65000 distinct marine animals\"},{\"title\":\"Chances to see marine experts dive and feed sharks\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(47, 'Dubai Mall Kidzania', 'dubai-mall-kidzania', '<p>You\'ve heard of Dubai Mall, but have you heard of Kidzania?</p>\r\n<p>Kidzania is a city that\'s built just for kids. It has a real airport, train station, and hospital&mdash;all staffed by real people who are trained to be role models for the children who visit. Kids can also pick up jobs in one of the stores at Kidzania, where they\'ll learn valuable skills like customer service and teamwork. They get paid in \"Kidzos,\" which they can spend on fun things like ice cream or pizza.</p>\r\n<p>The best part? Even if your child isn\'t old enough to work (the minimum age is 3), they can still play with friends their own age in the park or go shopping at Kidzania\'s giant mall. There are tons of rides and games for kids ages 3-12, so it\'s a great place for families to spend time together!</p>', 895, 687, NULL, 1, 11, 'Dubai Mall Kidzania, The Dubai Mall, 2nd Floor, Dubai Mall, Downtown Dubai - Dubai.', NULL, NULL, 8, NULL, '691,688,687,686,', NULL, '99.00', '60.00', 5, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 22:07:19', '2022-05-26 22:00:03', 1, '[{\"title\":\"Entry passes to the world of Kids\"},{\"title\":\"Over 80 role playing activities for the social development of your child.\"},{\"title\":\"Supervisor\\u2019s guidance to help your child enjoy the educational city to the fullest\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(48, 'Dubai Ice Rink', 'dubai-ice-rink', '<p>Dubai Ice Rink</p>\r\n<p>Shiver in the cold, but stay warm with fun.</p>\r\n<p>Get your skates on and head to the Dubai Ice Rink! This 25-meter long ski slope has been specially created in the heart of Mall of the Emirates. The rink is open 24 hours a day and is the perfect place to go if you want to have some fun with friends or family.</p>\r\n<p>The Dubai Ice Rink has been designed by international experts who specialize in designing outdoor ice rinks. The rink has been built using state-of-the-art technology and high quality materials. It also has an artificial snow machine that helps maintain the temperature at -5 degrees Celsius throughout the year so you can enjoy skating whenever you want.</p>\r\n<p>The rink offers many activities that will keep you entertained all day long including a skating school where you can learn how to skate or improve your skills, as well as an ice bar where you can have hot drinks while enjoying views of Dubai&rsquo;s skyline and beyond from above ground level thanks to our glass flooring system which offers 360 degree views around all four sides of our building including downstairs from level 3 onwards too!</p>', 894, 824, NULL, 1, 11, 'Dubai Ice Rink - Ground Level, The Dubai Mall - Dubai', NULL, NULL, 8, NULL, '666,621,', NULL, '110.00', '75.00', 2, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 22:10:59', '2022-05-26 21:59:32', 1, '[{\"title\":\"Dubai Ice Rink Tickets\"},{\"title\":\"The ticket includes - 90 minutes of skating to snowfall and music, complimentary helmets for children\'s,  skate rental, socks and locker hire.\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(49, 'Ski Dubai', 'ski-dubai', '<p>Ski Dubai is an indoor ski resort that offers the best conditions for skiing all year round. It&rsquo;s located in Mall of the Emirates and has more than 200 pistes that are spread across 1.5 km. There are also a number of other activities available at Ski Dubai including snow sledding, snowboarding and tubing as well as a variety of restaurants and cafes where you can refuel after your day on the slopes.</p>\r\n<p>At Ski Dubai, you can choose from one of three different skiing areas: the beginner slope, intermediate slope, or expert slope. The beginner slope has a gentle incline that allows you to get used to your skis or snowboard before taking them on any of the more challenging courses around the resort. On the intermediate and expert courses, you\'ll find longer slopes with steeper inclines&mdash;perfect for those who are ready to take their skills up a notch!</p>\r\n<p>You can also choose from two different types of lift tickets at Ski Dubai: One-day tickets allow you access to all three slopes during your visit; multi-day tickets give you access to all three slopes at once plus discounts on meals at restaurants inside Ski Dubai (which serve traditional Arabic cuisine).</p>', 893, 471, NULL, 1, 11, 'Ski Dubai, Sheikh Zayed Rd - Dubai.', NULL, NULL, 8, NULL, '472,471,', NULL, '263.00', '263.00', 6, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 22:15:56', '2022-05-26 21:59:13', 1, '{\"1\":{\"title\":\"Ski\\/Snowboard equipment, Jackets, trousers, disposable socks, snow boots, fleece gloves, Helmets will be provided at the venue for safety measures.\"},\"3\":{\"title\":\"Snow Cavern, Tobogganing, Giant Ball, Bob sledge, Tubing Run and Bump Car\"},\"4\":{\"title\":\"One-time Ride Chairlift\"},\"5\":{\"title\":\"One-time Ride Mountain Thriller\"}}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(50, 'Madame Tussads Museum', 'madame-tussads-museum', '<p>Madame Tussauds is the world\'s most famous wax museum.</p>\r\n<p>Madame Tussauds has been entertaining people since it opened in London in 1835. Today, the museum has over 150 locations and attracts more than 8 million visitors per year.</p>\r\n<p>The Dubai branch of Madame Tussauds is located in the heart of the city and is one of the most popular tourist attractions in Dubai. The museum attracts over 1 million visitors every year who come to see more than 300 life-like wax figures of famous celebrities, politicians, sports icons and historical figures.</p>', 892, 444, NULL, NULL, 11, 'Bluewaters - Bluewaters Mall - Bluewaters Island - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '843,842,707,', NULL, '135.00', '135.00', 2, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 22:20:31', '2022-05-26 21:58:46', 1, '[{\"title\":\"Entry tickets to Madame Tussauds Museum Dubai\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(51, 'Ferrari World Abu Dhabi', 'ferrari-world-abu-dhabi', '<p>Ferrari World Abu Dhabi is the world\'s first Ferrari theme park.</p>\r\n<p>It is the only place in the world where you can enjoy a real Ferrari ride, meet your favorite Ferrari characters and experience the thrills and excitement of a Ferrari-themed adventure.</p>\r\n<p>The park has over 20 rides, including roller coasters and simulators. It also has a 1.7 km long Grand Prix track that takes you through 30 iconic Formula 1 race tracks, including Monza, Silverstone and Spa-Francorchamps.&nbsp;</p>\r\n<p>In addition to this, there are more than 100 different attractions for kids, including the newest attraction at Ferrari World Abu Dhabi: Ferrari Karting Challenge. The karting challenge features four tracks inspired by famous F1 circuits around the world: Spa-Francorchamps, Silverstone Circuit in England, Autodromo Nazionale Monza in Italy and Marina Bay Street Circuit in Singapore.</p>', 891, 399, NULL, NULL, 12, 'Ferrari World - Yas Waterworld - Abu Dhabi - United Arab Emirates.', NULL, NULL, 8, NULL, '399,656,654,', NULL, '295.00', '295.00', 10, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 22:24:38', '2022-05-26 21:58:16', 1, '[{\"title\":\"General Admission ticket to Ferrari world Abu Dhabi\"},{\"title\":\"Access to 25 racing-themed rides, shows and attractions.\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(52, 'Green Planet Dubai', 'green-planet-dubai', '<p>The Green Planet is Dubai&rsquo;s very own tropical rainforest and a sanctuary of exotic flora and fauna. It is the perfect spot for a family outing and even caters to fun events like a picnic brunch and swimming with piranhas.&nbsp;</p>\r\n<p>The venue\'s bio-dome is made up of four levels: the Canopy, the Midstory, the Forest Floor and the Flooded Rainforest. Each level discusses the role and importance every part of a rainforest plays.&nbsp;</p>\r\n<p>The Green Planet is an experience for all senses with creatures roaming around you in their natural habitat and waterfalls running strong against your body if you choose to swim in them.</p>\r\n<p>The Green Planet is located at one of Dubai&rsquo;s most popular lifestyle districts, City Walk. The rainforest adventure can be enjoyed before or after dining at one of the eateries located nearby.</p>', 890, 661, NULL, NULL, 11, 'Al Wasl Road and Safa Road, Dubai.', NULL, NULL, 8, NULL, '663,662,661,660,', NULL, '125.00', '109.00', 8, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 22:28:57', '2022-05-26 21:57:43', 1, '[{\"title\":\"Pick Up from hotel\"},{\"title\":\"Entrance ticket\"},{\"title\":\"Drop of at hotel\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(53, 'La Perle by Dragone Dubai', 'la-perle-by-dragone-dubai', '<p>Book tickets for La Perle &ndash; a show that combines breathtaking choreography with daring stunts, in a novel \'aqua theatre\'. You\'ll be on the edge of your seat as world-class artists perform remarkable feats, including aerial acrobatics, death-defying dives and unbelievable motorcycle tricks &ndash; this act never fails to impress.&nbsp;</p>\r\n<p>Created by the legendary artistic director Franco Dragone, the story of La Perle pays homage to the UAE&rsquo;s pearl diving history in spectacular style. The purpose-built theatre is truely remarkable; gushing waterfalls and torrents of rain flood the stage and then drain away within seconds</p>', NULL, NULL, NULL, 1, 11, 'Al Habtoor City - 260 Sheikh Zayed Rd - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, NULL, NULL, '364.00', '172.00', 2, 1, 100, NULL, 'draft', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 22:38:55', '2022-05-22 11:37:09', 1, '[{\"title\":\"La Pele Dragone Ticket\"},{\"title\":\"Access to the purpose-built aqua stage containing over 2.5 million liters of water\"},{\"title\":\"Enjoy the 90-minute show which deftly blends the aerial acrobats\\u2019 unequaled performance with cutting-edge special effects\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(54, 'La Perle by Dragone Dubai', 'la-perle-by-dragone-dubai-1', '<p>Book tickets for La Perle &ndash; a show that combines breathtaking choreography with daring stunts, in a novel \'aqua theatre\'. You\'ll be on the edge of your seat as world-class artists perform remarkable feats, including aerial acrobatics, death-defying dives and unbelievable motorcycle tricks &ndash; this act never fails to impress.&nbsp;</p>\r\n<p>Created by the legendary artistic director Franco Dragone, the story of La Perle pays homage to the UAE&rsquo;s pearl diving history in spectacular style. The purpose-built theatre is truely remarkable; gushing waterfalls and torrents of rain flood the stage and then drain away within seconds</p>', 889, 690, NULL, 1, 11, 'Al Habtoor City - 260 Sheikh Zayed Rd - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '690,689,', NULL, '364.00', '172.00', 2, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 22:38:55', '2022-05-26 21:57:07', 1, '[{\"title\":\"La Pele Dragone Ticket\"},{\"title\":\"Access to the purpose-built aqua stage containing over 2.5 million liters of water\"},{\"title\":\"Enjoy the 90-minute show which deftly blends the aerial acrobats\\u2019 unequaled performance with cutting-edge special effects\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(55, 'Ekart Zabeel Dubai', 'ekart-zabeel-dubai', '<p>At EKart Zabeel, located on the rooftop of The Dubai Mall Zabeel, thrill seekers will be able to experience a heart-pounding ride.</p>\r\n<p>Drive one of the electric karts at the Zoom past the Burj Khalifa, where you can race against other drivers for AED75 per session. It\'s an environmentally friendly track, so you know that you\'re helping Dubai become the green city it strives to be.</p>\r\n<p>Although there\'s high speed action, you\'ll also have a chance to relax with a food truck onsite serving delectable dishes and drinks.</p>', 888, 635, NULL, 1, 11, 'Financial Center Rd - Za\'abeel - Za\'abeel 2 - Dubai', NULL, NULL, 8, NULL, '639,638,637,635,', NULL, '95.00', '89.00', NULL, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 22:43:47', '2022-05-26 21:56:39', 1, '[{\"title\":\"Safety briefing\"},{\"title\":\"Jumpsuit & helmet provided\"},{\"title\":\"Lap time recorded & shared by email\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(56, 'Desert Safari with dune bashing', 'desert-safari-with-dune-bashing', '<p>Get ready for an adventure like no other, with Desert Safari with dune bashing in dubai.</p>\r\n<p>Get ready to experience the thrill of a lifetime when you explore the desert on a camel and enjoy dune bashing. This is no ordinary trip: it\'s an experience that will leave you breathless!</p>\r\n<p>If you love adventure, this is the trip for you. The dune bashing will be exciting, but it\'s nothing compared to what awaits at the end of your journey. You\'ll climb aboard a camel for a ride through the desert (while being careful not to fall off!). The views are breathtaking, and the camels are sure-footed&mdash;they know where they\'re going!</p>', 887, 636, NULL, NULL, 11, 'Al Aweer Desert Camp, Dubai, UAE', NULL, NULL, 8, NULL, '636,634,631,630,', NULL, '350.00', '159.00', 6, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 22:52:41', '2022-05-26 21:56:10', 1, '[{\"title\":\"Pick up from your location by any 4x4 Vehicle\"},{\"title\":\"Dune bashing in fully air-conditioned 4x4 Vehicle\"},{\"title\":\"Unlimited refreshments\"},{\"title\":\"Sunset photography opportunity\"},{\"title\":\"Henna designing\"},{\"title\":\"Tanura show by male artist\"},{\"title\":\"BBQ dinner with a variety of vegetarian and non-vegetarian dishes\"},{\"title\":\"Shisha smoking facility at the shisha corner\"},{\"title\":\"Fire show\"},{\"title\":\"Photographic opportunity by dressing up in Arabic dress\"},{\"title\":\"Belly dancing\"},{\"title\":\"Camel riding\"},{\"title\":\"Drop off at your location by any 4x4 Vehicle\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(57, 'Desert Safari with quad bike', 'desert-safari-with-quad-bike', '<p>Your Desert Safari with quad bike in Dubai</p>\r\n<p>Dubai, a city of beauty, glitz and glamor, is now ready to show you one of its hidden secrets.</p>\r\n<p>Let us take you on an exciting adventure through the desert on a quad bike! Our Desert Safari will take you to some of the most beautiful spots in Dubai including Jumeirah Mosque, Dubai Museum and Burj Khalifa - the tallest building in the world. You\'ll also get to see Downtown Dubai - a vibrant hub for culture, food and shopping.</p>\r\n<p>You\'ll have plenty of time to explore these places at your own pace before returning back to your hotel or resort.</p>', 886, 720, NULL, NULL, 11, 'Al Aweer Desert Camp, Dubai, UAE', NULL, NULL, 8, NULL, '725,724,723,720,', NULL, '410.00', '349.00', 6, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 23:00:12', '2022-05-26 21:55:32', 1, '[{\"title\":\"Pick up from your Hotel\"},{\"title\":\"Thrilling dune bash in a well-maintained 4x4 vehicle\"},{\"title\":\"Sunset photographic opportunity\"},{\"title\":\"20 Minutes Quad biking  - Can be upgraded on extra charges\"},{\"title\":\"Henna designing\"},{\"title\":\"Camel Riding\"},{\"title\":\"Traditional BBQ dinner\"},{\"title\":\"Shisha smoking facility at the shisha corner\"},{\"title\":\"Fire show\"},{\"title\":\"Unlimited refreshments\"},{\"title\":\"Live entertainment shows like Tanoura Show and Belly dance\"},{\"title\":\"Drop off at your Hotel\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(58, 'Jebel Jais Zipline', 'jebel-jais-zipline', '<p>Ziplining In Jebel Jais</p>\r\n<p>Jebel Jais is a sandstone mountain located in Ras Al Khaimah, United Arab Emirates. The mountain has the longest zipline in the world at 4,200 meters (2.5 miles) long and is a popular tourist attraction for those visiting Ras Al Khaimah.</p>\r\n<p>The zipline covers three different areas of Jebel Jais: The Summit, The Canyon and The Valley. The Summit is the highest point on the mountain at 1,858 m (6,113 ft) above sea level and offers views over Ras Al Khaimah\'s coastline and Dubai\'s skyline. The Canyon section is 1,800 m (5,906 ft) above sea level and provides an adrenaline rush as you fly over rocks and ravines with nothing but your harness keeping you safe; while The Valley section gives you a chance to enjoy some spectacular scenery as you fly through trees and over waterfalls.</p>', 882, 674, NULL, NULL, 11, 'Jebel Jais Flight, Jebel Jais - Ras al Khaimah - United Arab Emirates', NULL, NULL, 8, NULL, '674,671,670,', NULL, '436.00', '436.00', NULL, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 23:04:53', '2022-05-26 21:54:59', 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(59, 'Xline Dubai Marina', 'xline-dubai-marina', '<p>Ready, set, go! XDubai has upped the ante with its latest adventure offering, XLine &ndash; a zipline that is the world\'s longest urban zipline.</p>\r\n<p>Located in Dubai Marina, it is one of the fastest and tallest ziplines around the globe. It measures 1km in length and has an average speed of 80km/h. You\'ll enjoy a bird\'s-eye vantage point of the glitzy Dubai neighborhood below, complete with five-star yachts and sleek high-rise towers.</p>\r\n<p>The XLine uses &lsquo;superman&rsquo; harnesses, allowing participants to lie belly-down and maximise on a thrilling flight-like experience as well as the panoramic views. There are two concurrently running ziplines, allowing you to share the experience with a friend or loved one.</p>\r\n<p>For an extra fee, you can wear a GoPro camera on your helmet and relive and share the action; each participant will receive a customised video and photograph of their ride.</p>', 881, 491, NULL, 1, 11, 'Level P, Dubai Marina Mall, Dubai.', NULL, NULL, 8, NULL, '492,491,490,489,', NULL, '743.00', '650.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 23:08:20', '2022-05-26 21:52:27', 1, '[{\"title\":\"Safety gear\"},{\"title\":\"Images and video recordings of your jump\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(60, 'Rental Yatch', 'rental-yatch', '<p>Rent a yacht in Dubai and explore the dazzling waters of this stunning city. Experience the freedom of the open sea on a luxury yacht, without having to worry about piloting it or docking it. You can sit back and relax as you sail through Dubai\'s amazing waterways, taking in all the sights of one of the world\'s most beautiful cities. Renting a yacht in Dubai is a great way to experience this exciting city in a whole new way.</p>\r\n<p>There are many different types of yachts available for rental in Dubai, including catamarans and sailboats. These vessels range in size from 35 feet up to 150 feet long, and they can accommodate anywhere from two guests up to 10 guests at once.</p>\r\n<p>Renting a yacht in Dubai is easy - just contact us today!</p>', 880, 727, NULL, 1, 11, 'Marina/Jumeirah', NULL, NULL, 8, NULL, '729,727,494,', NULL, '500.00', '425.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 23:11:58', '2022-05-26 21:49:41', 1, '[{\"title\":\"Professional Crew\"},{\"title\":\"1 Hour Cruising in Marina Lagoon\"},{\"title\":\"Life jacket\"},{\"title\":\"Refreshments (Water and Soft Drinks)\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(61, 'Private car with driver', 'private-car-with-driver', '<p>When you\'re traveling to Dubai, you deserve to enjoy it in style.</p>\r\n<p>We offer you a great way to see Dubai with our private guided tour in a luxury sedan.&nbsp;</p>\r\n<p>Whether you\'re heading out for dinner with friends or taking your family on a day trip to see the sights, we can take care of every detail&mdash;from reserving your spot at the restaurant to planning out exactly where you want to go and what sights you want to see.</p>\r\n<p>You\'ll have an experience like no other as you explore Dubai\'s culture, history, and modern marvels on your own terms. Our drivers are experts in their field and will be happy to answer any questions about Dubai that come up along the way.</p>', 879, 718, NULL, 1, 11, NULL, NULL, NULL, 8, NULL, '722,721,719,718,', NULL, '710.00', '710.00', 8, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 23:19:01', '2022-05-26 21:49:15', 1, '[{\"title\":\"Transfers will be available only on Private basis.\"},{\"title\":\"Pick up from your Hotel\"},{\"title\":\"Transfers in well maintained air-conditioned vehicle (Dubai Only)\"},{\"title\":\"Drop back to your Hotel\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(62, 'Ain Dubai Observation Wheel', 'ain-dubai-observation-wheel', '<p>Ain Dubai, the latest landmark to join Dubai&rsquo;s long list of world-record breaking attractions, is also the highest and largest observation wheel in the world. It stands at a staggering height of 250m on Bluewaters Island.</p>\r\n<p>The monument is an impressive feat of construction, with each leg standing 126m high&mdash;long enough to fit 15 London buses&mdash;while the weight of the assembled hub and spindle is equivalent to four A380 aircrafts.</p>\r\n<p>Accessible from the island, the Dubai Eye is surrounded by unforgettable experiences that make it a must-visit attraction for all.</p>\r\n<p>Ain Dubai, situated across the water from the popular Jumeirah Beach Residences beachfront, offers a relaxing and mesmerizing view of Dubai\'s urban skyline. With 48 air-conditioned passenger cabins and 1,750 visitors in each rotation, the ride takes 38 minutes.</p>\r\n<p>Ain Dubai is more than just a viewing platform for transforming city perspectives; it&rsquo;s also a world-class entertainment zone with a large LED screen mounted on it.</p>', 878, 832, NULL, NULL, 11, 'Bluewaters - Bluewaters Island - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '540,533,532,534,', NULL, '150.00', '130.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 23:24:10', '2022-05-26 21:48:38', 1, '[{\"title\":\"Ain Dubai Entry Ticket\"},{\"title\":\"38 minutes spin\"},{\"title\":\"360 degree views over Dubai\\u2019s skyline\"},{\"title\":\"Access to shared Observation Cabin or Premium Cabin (with soft drinks and VIP lounge)\"},{\"title\":\"Free Wi-Fi\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(63, 'Dhow Cruise Dinner Creek', 'dhow-cruise-dinner-creek', '<p>At Ramee Dhow Cruise, you can take a trip down the Creek on an authentic wooden boat, drifting past modern skyscrapers and historic buildings alike. As you pass by souks and heritage sites, you\'ll be able to experience both sides of Dubai\'s history&mdash;the old and the new.</p>\r\n<p>Ride the waves to a private island and enjoy an Arabian buffet with refreshing beverages as you sail away from Dubai on a dhow cruise. You\'ll be treated to authentic Arabic cuisine and traditional folk music by local musicians.</p>\r\n<p>Your cruise departs daily at 8pm, but you can book group tours in the afternoon.</p>\r\n<p>If you\'re looking for a unique way to enjoy the water and all its glory, take a cruise on the Creek. You can hire a dhow for a private event and enjoy the spectacular views of the Creek waters as you cruise down its gentle waves. You\'ll have an experience to remember.</p>', 877, 783, NULL, 1, 11, 'Al Seef Road Marsa, Al Seef Walk Bur Dubai, Opposite British Embassy, Dubai', NULL, NULL, 8, NULL, '592,590,', NULL, '115.00', '63.00', 2, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 23:29:18', '2022-05-26 21:48:12', 1, '[{\"title\":\"90 minutes cruising near to Bur Dubai and Deira creek area\"},{\"title\":\"Welcome drinks, Water, Tea & Coffee.\"},{\"title\":\"International buffet dinner with a choice of vegetarian and non-vegetarian dishes\"},{\"title\":\"Access to fully air-conditioned lower deck and open-air upper deck\"},{\"title\":\"Tanura show and soft background music\"},{\"title\":\"Pick up & Drop Off Facility (If Sharing\\/Private Transportation option selected)\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(64, 'Dhow Cruise Dinner Marina', 'dhow-cruise-dinner-marina', '<p>Imagine yourself sailing through the alluring waters of Dubai Marina, surrounded by glittering towers of Dubai. It much seems like an imaginary concept, but with Dhow Cruise Dubai Marina, you can explore the illuminating skylines of the city sailing through the pristine waters.</p>\r\n<p>The Dubai Marina, also known as an artificial canal city, is the most iconic Dubai attraction, dotted with illuminating skyscrapers displaying the magnificent infrastructure of Dubai.</p>\r\n<p>The Dhow Cruise Dinner is a unique way to experience Dubai&rsquo;s Marina area and enjoy a delicious dinner on board while admiring this magical skyline.</p>\r\n<p>Our dinner dhow cruise on Dubai Marina is the perfect way to enjoy some alone time with your friends, or with your family. You\'ll get a complimentary drink upon arrival, great food, stunning views, and revitalising entertainment activities aboard.</p>', 877, 590, NULL, 1, 11, 'Dhow Cruise Marina, Behind Signature Hotel Apartments & Spa.', NULL, NULL, 8, NULL, '592,590,589,332,', NULL, '190.00', '125.00', 2, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 23:33:52', '2022-05-26 21:47:55', 1, '[{\"title\":\"International 4-Star buffet with Veg & Non-Veg dishes.\"},{\"title\":\"90 minutes Cruising in Dubai Marina, Yacht Club, Marina Towers.\"},{\"title\":\"Welcome drinks, Water, Tea & Coffee\"},{\"title\":\"Tanura show and soft background music\"},{\"title\":\"Pick up & Drop Off Facility (If Sharing\\/Private Transportation option selected)\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(65, 'Musandam Dibba Tour', 'musandam-dibba-tour', '<p>Musandam Dibba Tour is a perfect tour to escape from the glistening sights and buzzing crowd of Dubai! Embark on our Musandam Dibba Tour which introduces you to some of Arabian Peninsula&rsquo;s most astonishing natural splendors.</p>\r\n<p>The Musandam Dibba Tour is a haven for nature lovers. Its majestic landscape&mdash;with crystal clear, towering mountain range, jagged coastline, and salubrious climate&mdash;will leave you awestruck.</p>\r\n<p>The first thing that strikes you about this area is its amazing blue waters. The water here is so clear that you can see right to the bottom. If you&rsquo;re a water sport aficionado, go for an exhilarating banana boat ride or try fishing. If you want to take it easy, there are plenty of opportunities to simply relax and soak in the tranquil beauty of this place. With its breathtaking scenery, breath-taking views and all-encompassing tranquility, it will leave you feeling refreshed and revitalised.</p>\r\n<p>You&rsquo;re here to enjoy a once-in-a-lifetime experience. We get that.That&rsquo;s why we make sure you have all the refreshments and snacks to keep you going throughout this incredible cruise.</p>\r\n<p>So contact our representatives today to book your trip to Musandam Dibba tour, and experience one of your life&rsquo;s most memorable moments!</p>', 801, 801, NULL, 1, NULL, 'Dibba Al Hisn Border Check point Corniche St, Dibba, Oman.', NULL, NULL, 8, NULL, '876,595,593,594,', NULL, '199.00', '199.00', 5, 1, 100, '[{\"title\":\"Important Information\",\"content\":\"Border pass will be processed by us (it is free of charge) and it will remain at the Dibba checkpoint. It may take 3 to 4 working days to process Border pass. Please ensure you carry your Passport along with you at the time of your tour.\\r\\nFor tourist Visa holders the Border crossing permit gets processed within a days time.It is mandatory to carry a Valid Passport along as the tour crosses the army check point.\\r\\nIt is also mandatory for all guests to carry the original Passport at the time of your Tour.\\r\\nThe Pick up will be arranged from your Dubai hotel \\/ residence only and not from the Airport.\\r\\nThe pick up \\/ drop off timing on Sharing transfers can be modified as per the trip schedule by 30 to 60 minutes, depending on traffic conditions and your location.\\r\\nIn case you select Without Transfers you are required to report at the location at least 30 minutes before the cruise departure time.\\r\\nSharing transfers is available from Deira, Bur Dubai, Sheikh Zayed upto Marina.\\r\\nSpecial Note\\r\\n\\r\\nIt is mandatory for you to carry your Passport copy with you at the time of your Tour or else your entry at the border will be restricted.\\r\\nBanana Boat Ride & Deep Sea fishing are subject to the current weather conditions.\"}]', 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 23:40:13', '2022-05-26 21:47:26', 1, '[{\"title\":\"5 Hours Musandam Dhow cruise departing from Dibba harbor\"},{\"title\":\"Continental Buffet lunch with refreshments\"},{\"title\":\"Banana Ride\"},{\"title\":\"Fishing & Swimming with life jackets\"},{\"title\":\"Snorkeling with Equipment\'s\"},{\"title\":\"Pick up & Drop Off Facility (If Sharing\\/Private Transportation option selected)\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(66, 'Dubai Water Canal Cruise', 'dubai-water-canal-cruise', '<p>Experience a Royal Cruise on the Dubai Water Canal with Dinner.</p>\r\n<p>Imagine taking a leisurely cruise on the Dubai Water Canal, surrounded by shimmering city lights and the smell of fresh sea air. Imagine sitting down for an international buffet dinner with your friends or family and being treated like royalty. That\'s exactly what our Royal Cruise Dinner is all about!</p>\r\n<p>The Royal Cruise Dinner is a 2-hour cruise along the Dubai Water Canal, where you\'ll be treated to an enchanting view of the city skyline. This is a unique experience that can\'t be had anywhere else in Dubai&mdash;it\'s truly one-of-a-kind! You\'ll enjoy a traditional cruise on an authentic Arabian boat, complete with all the modern facilities you\'d expect from such a high-class establishment. The interior is decorated with exquisite Arabian decor and fine furniture, while your crew will treat you like royalty at every turn.</p>\r\n<p>After your cruise has ended, it\'s time for dinner! Our international buffet dinner features some of the finest dishes made by some of the best chefs in the world&mdash;and they\'re sure to delight your palette no matter what kind of food you prefer!</p>', 875, 632, NULL, NULL, 11, NULL, NULL, NULL, 8, NULL, '633,632,627,625,', NULL, '250.00', '250.00', 3, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 23:43:48', '2022-05-26 21:46:16', 1, '[{\"title\":\"2.5 Hours Cruising\"},{\"title\":\"Welcome drinks\"},{\"title\":\"International Buffet Dinner\"},{\"title\":\"Pick up & Drop Off Facility (If Sharing\\/Private Transportation option selected)\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(67, 'Birthday Party at Dhow Cruise', 'birthday-party-at-dhow-cruise', '<p>Birthday Party Dhow Cruise on Dubai Creek &ndash; the perfect way to celebrate your special day!</p>\r\n<p>If you&rsquo;re looking for a different way to celebrate your birthday, look no further than our birthday party dhow cruise. Our expert team will carefully put together your own cruise package, so you can enjoy a unique experience and cherish it forever. Whether you&rsquo;re celebrating turning one year older or celebrating a landmark age, our professional team will make sure that your party is unforgettable.</p>\r\n<p>Sail along the Dubai Water Canal in our Arabian dhow, a stupefying mix of timeless castles and dazzling skyscrapers along the Dubai Creek provides the perfect backdrop for an unforgettable birthday celebration. You can hire apart (lower or upper deck) or even whole of our twin-decked wooden dhow for your exclusive use.</p>\r\n<p>We have options to fit any group size, from 25 to 250 people. And we offer a slew of international gourmet specialties, traditional Tanura show and decorations that would befit your birthday function. We also offer a spectrum of optional extras to add to your distinctive two-hour cruise merriment; fresh floral arrangements, personalized birthday cakes, cocktails, and special gifts to name a few.</p>\r\n<p>So book our premium cruise package and relieve yourself from the hassles of finding the right venueor planning a perfect birthday party in Dubai.</p>', 759, 759, NULL, NULL, 11, 'Deira Creek, Al Baniyas Road, next to Radisson Blu Hotel, Opposite Dubai Municipality Head Office', NULL, NULL, 8, NULL, '553,551,550,', NULL, '2500.00', '2260.00', 2, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-21 23:48:04', '2022-05-26 21:45:43', 1, '[{\"title\":\"2 Hours Cruising\"},{\"title\":\"Cake\"},{\"title\":\"Cruise decoration with Balloons\"},{\"title\":\"Live Tanura show\"},{\"title\":\"International Buffet Dinner\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(68, 'Dhow Brunch in Dubai Marina', 'dhow-brunch-in-dubai-marina', '<p>A Dhow Brunch in Dubai is the perfect way to kick back, relax and watch the world go by. You\'ll be able to enjoy a delicious brunch with friends, catch up with old faces and make new ones while taking in the most iconic sights of Dubai - all while enjoying our resident DJ\'s tunes on the decks!</p>\r\n<p>On this cruise, you\'ll be able to enjoy an unlimited amount of brunch with your friends as well as live entertainment, all while taking in some of Dubai\'s most iconic sights. No doubt about it&mdash;this is going to be a great time!</p>\r\n<p>This bottomless brunch will be like no other as you ride along Dubai Marina with a glass of fizz in hand, and if that isn\'t enough, our resident DJ will be on the decks to ensure your celebrations get off to a rousing start!</p>', 874, 799, NULL, 1, 11, 'Dhow Cruise Marina, Behind Signature Hotel Apartments & Spa.', NULL, NULL, 8, NULL, '589,332,', NULL, '250.00', '200.00', 3, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 00:04:36', '2022-05-26 21:44:59', 1, '{\"0\":{\"title\":\"3 Hour Dhow Cruise at Dubai Marina\"},\"1\":{\"title\":\"International 4-Star buffet with Vegetarian & Non-Vegetarian dishes\"},\"2\":{\"title\":\"Welcome drinks, Water, Tea & Coffee\"},\"4\":{\"title\":\"DJ and Live Entertainment\"},\"5\":{\"title\":\"Up-close views over iconic Dubai sights\"},\"6\":{\"title\":\"Pick up & Drop Off Facility (If Sharing\\/Private Transportation option selected)\"}}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `bc_tours` (`id`, `title`, `slug`, `content`, `image_id`, `banner_image_id`, `short_desc`, `category_id`, `location_id`, `address`, `map_lat`, `map_lng`, `map_zoom`, `is_featured`, `gallery`, `video`, `price`, `sale_price`, `duration`, `min_people`, `max_people`, `faqs`, `status`, `publish_date`, `create_user`, `update_user`, `deleted_at`, `origin_id`, `lang`, `created_at`, `updated_at`, `default_state`, `include`, `exclude`, `itinerary`, `review_score`, `ical_import_url`, `date_form_to`, `min_age`, `pickup`, `wifi_available`, `enable_service_fee`, `service_fee`, `surrounding`, `min_day_before_booking`) VALUES
(69, 'AL Montazah Water Park', 'al-montazah-water-park', '<p>Al Montazah Amusement and Water Park is the number one family destination in Sharjah. It offers thrilling water rides and lavish leisure amenities. Thanks to its strategic location near the Government Departments Complex, Central Market, and Khalid Lagoon in Sharjah, Al Montazah has become one of the fastest growing tourist destinations in the UAE.</p>\r\n<p>Al Montazah provides 500 parking lots, including disability bays, with additional facilities also available at Flag Island located opposite.</p>\r\n<p>Al Montazah was the recipient of the Sharjah Tourism Excellence Award for 2014 as the best new tourist destination in the emirate in recognition of its world-class facilities and services that have made it a must-visit destination for residents and tourists.</p>', 873, 539, NULL, NULL, 11, NULL, NULL, NULL, 8, NULL, '539,537,', NULL, '100.00', '100.00', 12, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 09:12:50', '2022-05-26 21:44:33', 1, '[{\"title\":\"Free parking space available\"},{\"title\":\"Free Wi-Fi Available at the Park\"},{\"title\":\"Pearls Kingdom Water Park\"},{\"title\":\"Entry ticket to the Pearls Kingdom\"},{\"title\":\"Free sunbeds and life jackets are available on a first-come first-serve basis\"},{\"title\":\"Riding tubes, as well as children\\u2019s life vests, are provided free of charge and should be used on the rides that require them\"},{\"title\":\"Hotel pick up and drop off (only if transfer option chosen at the time of booking)\"},{\"title\":\"Island of Legends Amusement Park\"},{\"title\":\"Admission ticket to Island of Legends\"},{\"title\":\"Take to its over 25 rides\"},{\"title\":\"Hotel pick up and drop off (only if transfer option chosen at the time of booking)\"},{\"title\":\"Pearls Kingdom Water Park and Island of Legends\"},{\"title\":\"Al Montazah Parks Admission Ticket\"},{\"title\":\"Entry to Pearls Kingdom Water Park and Island of Legends\"},{\"title\":\"Free sunbeds and life jackets are available on a first-come-first-serve basis\"},{\"title\":\"Riding tubes, as well as children\\u2019s life vests, are provided free of charge and should be used on the rides that require them\"},{\"title\":\"Endless access to both parks\\u2019 rides, slides and other attractions\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(70, 'Aqua Fun Water Park', 'aqua-fun-water-park', '<p>AQUA FUN Water Park is a must-visit destination for tourists and residents from 120+ countries. It\'s featured as the Top #5 things to do in Dubai, and it has been named as one of the top 3 water parks in the world.</p>\r\n<p>AQUA FUN is the ultimate destination for experiencing fun under the sun with your friends. Challenge yourself with friends to the most fun and entertaining obstacles course on planet earth. Capture funny, unforgettable, and priceless memories as you or your friends struggle around the world&rsquo;s largest inflatable aqua park sitting on the Gulf Sea. Measuring at 130M X 33M with over 72+ obstacles and 25 metres out at Sea. You will be in for an exciting adventure! Go ahead book today; you do not want to miss this!</p>', 872, 749, NULL, NULL, 11, 'The Jumeirah Beach, opposite - Dubai.', NULL, NULL, 8, NULL, '545,543,542,541,', NULL, '150.00', '105.00', 8, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 09:17:48', '2022-05-26 21:44:04', 1, '[{\"title\":\"Aqua Fun Entry Ticket(Full Day Access)\"},{\"title\":\"Access to Beach\"},{\"title\":\"Life Jackets\"},{\"title\":\"Life Guard\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(71, 'Burj Khalifa Ticket with The Cafe Treat', 'burj-khalifa-ticket-with-the-cafe-treat', '<p>Burj Khalifa is one of the most iconic buildings in the world. It\'s a marvel of modern architecture, and it\'s an experience you\'ll never forget.</p>\r\n<p>And now you can enjoy it from the best possible view&mdash;from your own table at The Caf&eacute;.</p>\r\n<p>With this Burj Khalifa package, you\'ll get to see Dubai from 124th, 125th and 148th levels (dependent on your ticket choice) as well as grab a delicious bite at The Caf&eacute; on its ground level. This package is perfect for those who want to take their time exploring Dubai and soaking up all it has to offer!</p>\r\n<p>When you book your ticket for the Burj Khalifa with The Cafe Treat, you\'ll be treated to a culinary experience unlike any other.</p>\r\n<p>Your ticket will cover access to the 125th level observation deck, which offers stunning views of Dubai. You can enjoy dazzling views from above, and see everything from the desert to the sea. You\'ll also have access to The Caf&eacute;\'s signature cappuccino along with the pastry of the day. This assures you of a culinary session infused with unparalleled luxury and hospitality.</p>', 871, 773, NULL, 1, 11, '1 Mohammed Bin Rashid Boulevard, Downtown Dubai, UAE.', NULL, NULL, 8, NULL, '566,565,', NULL, '300.00', '158.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 09:21:55', '2022-05-26 21:43:33', 1, '{\"0\":{\"title\":\"Access to Level 124\\/125th floor.\"},\"1\":{\"title\":\"Entrance Ticket to Observation Deck\"},\"3\":{\"title\":\"Complimentary coffee or soft drink at the cafe on the ground floor\"}}', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(72, 'Dubai Fountain Show and Lake Ride', 'dubai-fountain-show-and-lake-ride', '<p>The Dubai Fountain is located very next to Burj Khalifa and just outside of the Dubai Mall. Designed by the world-renowned WET Design, it is famed for its distinct and largest-of-its-kind choreographed fountain show, which is intricately entwined with jaw-dropping water, light, and music features. In fact, it&rsquo;s a must experience for any visitor traveling to Dubai.</p>\r\n<p>The lake ride is an amazing adventure that gives you an opportunity to view some of Dubai&rsquo;s most famous landmarks from another vantage point. The lake itself is man-made and offers an incredible view of the city from above as well as from below. The ride takes about 20 minutes in total, but once you reach your destination you will have time to explore before heading back down again.</p>', 925, 925, NULL, 5, 11, 'The Promenade - next to Dubai Mall - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '925,609,608,', NULL, '50.00', '30.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 09:27:31', '2022-06-21 13:12:51', 1, '[{\"title\":\"Sail across Burj Lake aboard a traditional abra\"},{\"title\":\"Spectacle the largest-of-its-kind choreographed fountain show\"},{\"title\":\"Be in awe at this water show featuring over 6500 WET superlights\"},{\"title\":\"Enjoy an up-close view of architectural delights like Burj Khalifa\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(73, 'Burj Khalifa Sky Tickets', 'burj-khalifa-sky-tickets', '<p>The Burj Khalifa Sky Tickets gives you an opportunity to experience the world\'s highest observation deck.&nbsp;</p>\r\n<p>If you are passionate about visiting skyscrapers, this is the place for you! The Burj Khalifa has been designed and built to provide visitors with an unforgettable experience. The view from the observation deck is breathtaking and will leave you breathless. The building itself is considered one of the wonders of modern architecture and engineering. The height of Burj Khalifa is 828 meters (2,717 feet), which makes it the tallest structure in the world. Moreover, Burj Khalifa crowns various interesting facts beneath its futuristic architecture. Among them, the world&rsquo;s highest elevator system with a total of 160 plus floors always remains the hot potato for every traveling enthusiast.</p>\r\n<p>Your visit is timed to 45 minutes and during this time, a guest ambassador will give you a tour of the premises after which you can step onto the Burj Khalifa observation deck and soak in the glorious view of Dubai&rsquo;s beautiful landscape. You can also participate in interactive experiences.</p>', 869, 775, NULL, NULL, 11, '1 Mohammed Bin Rashid Boulevard, Downtown Dubai, UAE', NULL, NULL, 8, NULL, '564,503,504,505,', NULL, '399.00', '375.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 09:32:28', '2022-05-26 21:41:55', 1, '[{\"title\":\"Entrance ticket to 148th Floor and 125th Floor Observation deck\"},{\"title\":\"Personalized attention of Official ambassadors\"},{\"title\":\"Refreshments (cold drinks snacks)\"},{\"title\":\"30 minutes on 148th floor\"},{\"title\":\"Interactive screen providing an excellent view of different corners of emirates\"},{\"title\":\"360-degree view\"},{\"title\":\"Visit 125th floor - as much time as you want to spend\"},{\"title\":\"Falcon eye view \\u2013 access to telescope from 125th floor\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(74, 'Etihad Museum', 'etihad-museum', '<p>If you&rsquo;re planning on visiting Dubai, check out the Etihad Museum. It&rsquo;s a great way to learn about the history of UAE, and it\'s located right next door to the Burj Khalifa!</p>\r\n<p>Located at the site of the Union House where the landmark agreement signifying the unification of UAE was signed in 1971, the Etihad Museum invites you to experience the country&rsquo;s distinctive culture, heritage, history and economic conditions both pre and post the formation of the UAE. An eclectic repertoire of old photographs, historic objects and intriguing artifacts from the sheiks&rsquo; personal collections await you here. This ranges from Sheikh Mohammed bin Hamad Al Sharqi&rsquo;s golden dagger to Sheik Rashid&rsquo;s passport.</p>', 868, 394, NULL, NULL, 11, '1 Jumeirah St - Al Mina - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '653,650,648,391,', NULL, '50.00', '45.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 09:38:43', '2022-05-26 21:41:20', 1, '[{\"title\":\"Etihad Museum Tickets\"},{\"title\":\"Entrance Ticket to Observation Deck (If option selected)\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(75, 'Falcon Tour Abu Dhabi', 'falcon-tour-abu-dhabi', '<p>The Abu Dhabi Falcon Tour is a must-see for any animal lover. The hospital is a safe space for animals in general, having provided shelter to dogs, cats and various others in need. Its glowing reputation is truly well-earned: more than 50,000 falcons have been treated and they&rsquo;ve received several records and many awards for their highly rewarding work! Animal lovers, we&rsquo;ve struck gold!</p>\r\n<p>You just want to meet the falcons?! Take a trip to the museum, home to well-nurtured beauties and several other species of birds too. You&rsquo;ll find yourself immersed in the history of falconry while you enjoy their flight. Smile for pictures with them to commemorate the moment.</p>\r\n<p>The falcon is a vital part of UAE\'s culture and heritage, therefore, a trip to Abu Dhabi would be incomplete without a visit to the exceptional Abu Dhabi Falcon Tour.</p>', 867, 649, NULL, NULL, 12, NULL, NULL, NULL, 8, NULL, '652,651,649,', NULL, '600.00', '530.00', 4, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 09:47:18', '2022-05-26 21:40:47', 1, '[{\"title\":\"Admission Tickets\"},{\"title\":\"Opportunity to learn the history of falconry\"},{\"title\":\"Memorable photo sessions with these Majestic birds\"},{\"title\":null}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(76, 'Emirates Park Zoo', 'emirates-park-zoo', '<p>The Emirates Park Zoo is one of the most exciting educational places in the UAE. It offers a wide range of activities and opportunities for you to interact with both wild and farm animals, as well as learn about them.</p>\r\n<p>The zoo was built on the premise that every guest will be able to appreciate nature all over again, after encountering new discoveries, unique experiences and unforgettable memories including interacting with their many farm and wild animals. The Emirates Park Zoo also boasts the Emirates Park Resort which offers luxury chalets in the middle of the zoo as well as deluxe rooms with a swimming pool, food and beverage section with a selection of different cuisines, kids\' play area and souvenir shop.</p>\r\n<p>You can also enjoy VIP experiences like breakfast with birds, breakfast with giraffes or lunch with leopards or crocodiles.</p>', 866, 641, NULL, NULL, 12, '12th St - Al Bahyah - Abu Dhabi - United Arab Emirates', NULL, NULL, 8, NULL, '647,646,641,390,', NULL, '125.00', '100.00', 5, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 09:50:56', '2022-05-26 21:40:09', 1, '[{\"title\":\"Entry Tickets to Emirates Zoo\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(77, 'Emirates National Auto Museum', 'emirates-national-auto-museum', '<p>The Emirates National Auto Museum is one of the most unique museums in Abu Dhabi. It\'s home to over 200 cars owned by His Highness Sheikh Hamad Bin Hamdan Al Nahyan, so if you\'re a car lover, this is definitely the place for you.&nbsp;</p>\r\n<p>The collection of vehicles ranges from classic American cars to off-road vehicles and rainbow-colored Mercedes. You\'ll also find plenty of photo opportunities outside the museum&mdash;like the retired passenger jet and world\'s largest model jeep parked outside&mdash;or inside, where you can explore the stunning collection up close. Fans of the BBC television programme Top Gear will notice some familiar cars too!</p>', 865, 643, NULL, 1, 12, 'South of Abu Dhabi, Hamim Road, Off E11, Al Dhafra - Abu Dhabi - UAE', NULL, NULL, NULL, NULL, '644,643,642,640,', NULL, '750.00', '560.00', 6, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 09:57:57', '2022-05-26 21:39:17', 1, '[{\"title\":\"Entry ticket to Emirates National Auto Museum\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(78, 'Dubai Garden Glow', 'dubai-garden-glow', '<p>The Dubai Garden Glow is a one-of-a-kind park that brings together art, history, and magic. You\'ll find yourself mesmerized by the dazzling displays of lights and ice sculptures in this beautiful park.</p>\r\n<p>The Dubai Garden Glow is divided into five zones: Dinosaur Park, Magic Park, Art Park, Ice Park and Fairy Tale Park. The Dinosaur Park will take you on a journey through prehistoric times while the Magic Park will take you on an adventure through animals portrayed through exquisite ice sculptures. The Fairy Tale Zone will bring you face to face with fairies from all over the world.&nbsp;</p>\r\n<p>The Art Zone displays over 25 fun exhibits and 3D artworks that will leave you in awe of their intricate details.</p>\r\n<p>The Dubai Garden Glow is open from 9 pm until 1 am every night during summer months (March to October). It\'s open from 8 pm until midnight during winter months (November to February).</p>', 864, 825, NULL, NULL, 11, 'Dubai Garden Glow, Zabeel Park Gate 6 & 7, Zabeel Area - Dubai', NULL, NULL, 8, NULL, '645,619,618,616,', NULL, '95.00', '80.00', 2, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 10:05:08', '2022-05-26 21:37:35', 1, '[{\"title\":\"Experience Dinosaur Park which takes you back in the era of the land of dinosaurs\"},{\"title\":\"Experience the sparkling \\u2018Art by Day\\u2019 and \\u2018Glow by Night\\u2019\"},{\"title\":\"Get an extraordinary amusement at Dubai Glow garden\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(79, 'Bollywood Parks Dubai Tickets', 'bollywood-parks-dubai-tickets', '<p>Bollywood Parks&trade; Dubai is a one-of-a-kind experience.</p>\r\n<p>It\'s an immersive experience that combines the excitement of rides with the thrill of interactive shows and multimedia experiences, all set in a world where Bollywood comes alive.</p>\r\n<p>You\'ll be able to explore a world where LEGO&reg; bricks come to life at LEGOLAND&reg; Dubai and LEGOLAND&reg; Water Park.</p>\r\n<p>Set your imagination racing with over 60 themed rides, slides, shows, building experiences and an entire year of awesome events! The ultimate destination for families with kids aged 2-12! You can book now on Klook and instantly enjoy two adventures with just one pass &ndash; just take your pick!</p>', 863, 761, NULL, NULL, 11, 'Sheikh Zayed Rd - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '559,556,554,552,', NULL, '330.00', '295.00', 9, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 11:02:59', '2022-05-26 21:37:08', 1, '[{\"title\":\"Entry ticket to the world\\u2019s first theme park dedicated to Bollywood\"},{\"title\":\"Access to its five move-themed zones\"},{\"title\":\"Enjoy colorful Bollywood based live entertainment shows\"},{\"title\":\"Take to amazing rides and attractions that relive the iconic Hindi movie characters or scenes\"},{\"title\":\"Experience Don, Krrish, Sholay etc with an exciting line-up of 3D and 4D rides\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(80, 'Chillout Ice Lounge Dubai', 'chillout-ice-lounge-dubai', '<p>Chillout Ice Lounge Dubai is a jaw-dropping attraction in Dubai where you can experience -6 degrees temperature in 50 degrees of Dubai heat. Not only the 1st in Dubai but Chillout Ice Lounge is the 1st in the whole of middle east which garners enough attention and crowd.&nbsp;</p>\r\n<p>Ice sculptures, ice seating and tables and a uniquely illuminated interior, all at a subzero temperature are somethings that will capture your attention throughout. Ice Shards, Stalactites and stalagmites all around the place makes it even more real and amazing to look at.</p>\r\n<p>It&rsquo;s an experience like no other where you can enjoy a drink while taking in some of the most beautiful sights in town; from stalactites hanging from the ceiling to ice sculptures covering every inch of this incredible venue!</p>', 862, 568, NULL, NULL, 11, 'Times Square Center – Sheikh Zayed Road – Dubai.', NULL, NULL, 8, NULL, '578,571,568,576,', NULL, '81.00', '72.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 11:04:15', '2022-05-26 21:36:47', 1, '[{\"title\":\"Admission to the Chillout Ice Lounge\"},{\"title\":\"Welcome drink (Hot chocolate or Tea)\"},{\"title\":\"Chicken bbq skewers (2 pcs per person)\"},{\"title\":\"Use of thermal clothing\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(81, 'Ifly Dubai', 'ifly-dubai', '<p>If you have ever wanted to fly, head over to the world\'s first double indoor skydiving simulator and test your skills. Enjoy an unforgettable experience at the iFly skydiving indoors - wind tunnel with professional instructors who will give you one-on-one instruction on how to take control of your body while flying inside the tunnel. Free-fall in safety and feel the adrenaline rush on a 2 minute flight time at this fantastic indoor skydive Dubai. This experience is safe for kids and adults alike and will definitely leave you with a smile.</p>\r\n<p>Whether it\'s your first time or not, we are open all year round so book now!</p>', 861, 669, NULL, NULL, 11, 'Third Floor, Play Nation Area, City Centre Mirdif, Ghoroob, Sheikh Mohammed Bin Zayed Road - United Arab Emirates', NULL, NULL, 8, NULL, '669,667,', NULL, '199.00', '129.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 11:24:30', '2022-05-26 21:36:20', 1, '[{\"title\":\"iFly Admission Tickets\"},{\"title\":\"20 mins briefing session\"},{\"title\":\"IFLY Gear: Flying Suite, Helmet, disposable socks & goggle\"},{\"title\":\"1 to 1 tunnel session with iFLY Instructor\"}]', '[{\"title\":\"Photos and Videos ( Available at additional cost)\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(82, 'VR Park Dubai', 'vr-park-dubai', '<p>Are you ready for a total mind-blowing experience that will challenge your concept of what is real?</p>\r\n<p>Try the world\'s first virtual reality and augmented reality attraction in Dubai! Avoid the dreaded long lines to get passes and go the VR Park anytime you desire with open dated tickets all year round. Have unlimited access and take on mind-blowing experiences and rides with genres ranging from adventure, horror, action, and many more. Prepare to challenge your concepts of what is real as the VR Park blurs the lines between perception and reality through the experiences offered inside.</p>', 860, 483, NULL, NULL, 11, 'The Dubai Mall - Financial Center Rd - Downtown Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '483,481,', NULL, '250.00', '199.00', 4, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 11:28:27', '2022-05-26 21:35:54', 1, '[{\"title\":\"VR Park Dubai \\u2018Pay & Play\\u2019 Pass (as per your selected games)\"},{\"title\":null}]', '[{\"title\":\"Arcade games, F&B\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(83, 'Banana Boat Ride', 'banana-boat-ride', '<p>Banana Boat Ride is one of the most popular activities in Dubai and you should not miss it if you are visiting Dubai for the first time. You will get to experience the exhilarating boat ride on an inflatable banana-shaped boat that takes you across the waters of Dubai. The best part about this activity is that it is safe, fun and enjoyable for everyone irrespective of age or physical fitness.</p>\r\n<p>The boats are designed in such a way that they are safe and comfortable with ample space for all passengers to sit comfortably. The best thing about this activity is that it has been designed keeping in mind that there should be no compromise on safety while at the same time ensuring an enjoyable ride without any hassle or discomfort.</p>\r\n<p>You will have an opportunity to sit on an inflatable banana-shaped boat along with other passengers while enjoying the sunbathing experience at Jumeirah Beach which offers white sand beach stretch with views of Burj Al Arab and other landmarks like Palm Island etc.,</p>', 859, 547, NULL, NULL, 11, 'Dubai', NULL, NULL, 8, NULL, '549,548,547,546,', NULL, '160.00', '112.00', NULL, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 11:31:53', '2022-05-26 22:20:23', 1, '[{\"title\":\"15 Min Banana Ride in Dubai Beach\"},{\"title\":\"Life Jackets\"},{\"title\":\"Safety instructions by Professionals\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(84, 'Banana Boat Ride', 'banana-boat-ride-1', '<p>Banana Boat Ride is one of the most popular activities in Dubai and you should not miss it if you are visiting Dubai for the first time. You will get to experience the exhilarating boat ride on an inflatable banana-shaped boat that takes you across the waters of Dubai. The best part about this activity is that it is safe, fun and enjoyable for everyone irrespective of age or physical fitness.</p>\r\n<p>The boats are designed in such a way that they are safe and comfortable with ample space for all passengers to sit comfortably. The best thing about this activity is that it has been designed keeping in mind that there should be no compromise on safety while at the same time ensuring an enjoyable ride without any hassle or discomfort.</p>\r\n<p>You will have an opportunity to sit on an inflatable banana-shaped boat along with other passengers while enjoying the sunbathing experience at Jumeirah Beach which offers white sand beach stretch with views of Burj Al Arab and other landmarks like Palm Island etc.,</p>', NULL, NULL, NULL, NULL, NULL, 'Dubai', NULL, NULL, 8, NULL, NULL, NULL, '160.00', '112.00', NULL, 1, 100, NULL, 'draft', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 11:31:53', '2022-05-22 11:36:26', 1, '[{\"title\":\"15 Min Banana Ride in Dubai Beach\"},{\"title\":\"Life Jackets\"},{\"title\":\"Safety instructions by Professionals\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(85, 'Yellow Boat', 'yellow-boat', '<p>Enjoy Yellow Boat in Dubai</p>\r\n<p>If you want to enjoy the beauty of Dubai, then you should go on a boat ride. The city has many attractions that are worth exploring and that\'s why it is one of the most visited places in the world. There are many attractions that you can visit during your stay here, but one of them is definitely the Yellow Boat. This boat is one of the most famous ones in Dubai and it offers tours around some of the most popular places in this city.</p>\r\n<p>The Yellow Boat has become very popular among tourists because it offers an amazing experience for everyone who wants to explore Dubai from the sea. It takes people through all kinds of places, such as Jumeirah Beach Residence and Palm Jumeirah Island, which makes it very interesting for everyone who goes on this tour with them.</p>', 858, 736, NULL, NULL, 11, 'Dubai Marina Walk, Marina Gate Next to The Coffee Club - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '736,735,734,', NULL, '175.00', '154.00', 2, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 11:41:08', '2022-05-26 21:34:57', 1, '[{\"title\":\"Life Jackets\"},{\"title\":\"Instructions by Professionals\"},{\"title\":\"Thrilling Boat Ride\"},{\"title\":\"Photo Opportunity\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(86, 'Crab Hunting', 'crab-hunting', '<p>If you&rsquo;re looking for something different to do in Dubai, we have just the thing. Crab hunting!</p>\r\n<p>The crab-hunting season is from November through April, and it is a great opportunity to soak up the region&rsquo;s striking natural beauty while trying your hand at something unique. In fact, this offers a refreshing antidote to escape from the hustles and bustles of Dubai.</p>\r\n<p>The real thrill begins as you wade across the shallow waters and hunt crabs with the help of a professionally trained boat crew. This activity is done during night at low tides in accompaniment to special underwater lights, especially making it a favorite of adventure seekers and fanatics of nocturnal activities alike. What&rsquo;s more, you can even do this thrilling yet safe activity with your little ones.</p>\r\n<p>Upon seizing all crabs within your reach, be prepared to relish yourself with a buffet dinner whose key highlight will be barbecued dishes cooked mainly with your catch of the day.</p>', 857, 732, NULL, NULL, 11, 'AlGhub street - Old Umm Al Quwain - Umm Al Quawain - United Arab Emirates', NULL, NULL, 8, NULL, '732,', NULL, '999.00', '876.00', 6, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 11:45:19', '2022-05-26 21:34:30', 1, '[{\"title\":\"Pick up from your Hotel\"},{\"title\":\"Light Snack Service with soft drink\"},{\"title\":\"Departure by boat at for Crab Hunting Up to 17pax in the boat\"},{\"title\":\"Crab Hunting near mangrove Islands of Umm Al Quwain with professional help and adequate supply of relevant equipment\\u2019s required for crab hunting\"},{\"title\":\"Dinner Buffet Service consisting of Continental Menu Items and Catch of the Day Crab Dish (Mineral Water - Tea\\/Coffee Unlimited)\"},{\"title\":\"Instructions by Professionals\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(87, 'Scuba Diving Tour', 'scuba-diving-tour', '<p>Scuba diving in Dubai is an incredible experience. Imagine diving underwater with the little marine animals to accompany you. Sounds exciting, right? Experience how it feels to be like a fish and dive deep in the water. Scuba diving in Dubai gives you an opportunity to explore the Persian Gulf and play with the aquatic animals. Crafted to meet the needs of both seasoned divers as well as those who are first-timers, this scuba diving in Dubai package ensures a perfect adventure.</p>\r\n<p>If you love exploring new places and meeting new people, this is just for you! We will take care of everything from start to end so that all you have to focus on is having fun.</p>\r\n<p>We offer a wide range of activities for everyone from children to seniors, including snorkeling, jet skiing, parasailing, kayaking, water skiing and wakeboarding. You can also enjoy many other land-based activities like sightseeing tours around Dubai Marina or Downtown Dubai where you can see Burj Khalifa (the world\'s tallest building), The Dubai Mall (the world\'s largest shopping mall) and more!</p>', 856, 730, NULL, NULL, 11, 'Bermuda Diving Center HQ - 604 Al Wasl Rd - Jumeirah 3 - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '731,730,', NULL, '400.00', '352.00', 3, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 11:48:27', '2022-05-26 21:34:02', 1, '[{\"title\":\"PADI accredited courses\"},{\"title\":\"A PADI video session that serves as a key to introduction to diving\"},{\"title\":\"30 minutes dive with a professional diver\"},{\"title\":\"Class includes safety techniques and tips for breath contro\"},{\"title\":\"Instructions by Professionals\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(88, 'Deep Sea Cruising', 'deep-sea-cruising', '<p>If you\'re looking for a new adventure and want to learn more about the ocean, then deep sea cruising is the perfect option. When you get on a deep sea vessel, you\'ll be able to explore the ocean at its deepest depths. You\'ll also have an opportunity to see some of the most beautiful creatures in the world as well as some of the most impressive sights.</p>\r\n<p>The best part is that it\'s not just for people who are experienced divers. You can take a trip with your family or friends and everyone will have a great time. The vessels will have all kinds of activities on board so that everyone has something to do while they\'re out there enjoying their time together.</p>\r\n<p>You won\'t have to worry about anything because everything has been taken care of ahead of time so that you don\'t have any worries or concerns about what might happen next!</p>', 855, 785, NULL, NULL, 11, 'Dubai Marina - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '528,529,', NULL, '1700.00', '1500.00', 2, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 11:51:51', '2022-05-26 21:33:32', 1, '[{\"title\":\"Marina lagoon and Jumeirah lake towers, cruising around Burj Al Arab hotel & Jumeirah Beach\"},{\"title\":\"Cruising around Palm Jumeirah & Atlantis hotel\"},{\"title\":\"The World Island\"},{\"title\":\"Refreshment\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(89, 'Donut Ride Dubai', 'donut-ride-dubai', '<p>If you\'re looking for an exhilarating experience on the water, look no further than Dubai\'s Gulf of Oman.</p>\r\n<p>Take a spin on the Donut, a donut-shaped ride towed by watercraft and spun with the help of centrifugal force. You\'ll feel like you\'re flying as your body is whipped around in circles.</p>\r\n<p>You\'ll have the chance to enjoy this activity with a professional instructor who will ensure your safety. This is an activity that is fun for families, friends or even colleagues!</p>', 854, 802, NULL, NULL, 11, NULL, NULL, NULL, 8, NULL, '527,526,', NULL, '156.00', '137.00', 1, 1, 100, '[{\"title\":\"Availability\",\"content\":\"Subject to Availability\"}]', 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 12:00:04', '2022-05-26 22:20:03', 1, '[{\"title\":\"15 Min Donut ride in Dubai Beach\"},{\"title\":\"Life Jackets\"},{\"title\":\"Safety instructions by trained professionals\"}]', NULL, NULL, NULL, NULL, NULL, NULL, 'Available', NULL, NULL, NULL, NULL, NULL),
(90, 'Kayaking Dubai', 'kayaking-dubai', '<p>Dubai is a city that is known for its many wonders, from the tallest building in the world to the largest mall. But there are also some hidden gems that make this city even more special. One of those is kayaking in Dubai. If you are looking for an activity that combines nature and adventure, then this is it!</p>\r\n<p>Kayaking can be done by anyone who has experience with swimming and feels comfortable on water. It does not require any special skills or training. All you need to do is rent one of the kayaks available at most beaches in Dubai and get started! There are several locations where you can do this activity, but we recommend The Palm Jumeirah Beach Park because it\'s near downtown and offers great views of both Dubai Marina and Downtown Dubai. You can also take advantage of their restroom facilities if needed!</p>', 853, 685, NULL, NULL, 11, 'Dubai International Marine Club - Dubai', NULL, NULL, 8, NULL, '525,524,523,', NULL, '125.00', '110.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 12:03:10', '2022-05-26 21:32:34', 1, '[{\"title\":\"Enjoy one-hour single Kayak \\/ double Kayak ride\"},{\"title\":\"Safety gears\"},{\"title\":\"Able to swim or tread water\"},{\"title\":\"Instructions by Professionals\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(91, 'Fly Boarding Dubai', 'fly-boarding-dubai', '<p>Flyboarding is the latest craze in water sports, and it\'s taking Dubai by storm.</p>\r\n<p>If you\'re looking for something to do that\'s a little more exciting than your typical beach day, then this is the adventure for you. It\'s a 30-minute experience where you strap yourself onto a jetpack-like device that shoots a powerful stream of water, propelling you into the air or through the water. You\'ll feel like your own superhero as you soar along!</p>\r\n<p>You\'ll be given a detailed safety briefing and instruction before using it, making sure that you know what you\'re doing on the flyboard. You will even get a headset that will allow a French-certified instructor to guide you as you soar along.\"</p>', 852, 405, NULL, NULL, 11, 'Palm Jumeirah - The Palm Jumeirah - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '519,520,521,522,', NULL, '390.00', '343.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 12:05:50', '2022-05-26 21:32:03', 1, '[{\"title\":\"20 Min Fly board Ride in Dubai Beach\"},{\"title\":\"Safety Gears\"},{\"title\":\"Instructions for the device use will be provided by the Instructor\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(92, 'Stand Up Paddle', 'stand-up-paddle', '<p>Stand Up Paddle is a sport that has been growing in popularity over the last decade. It\'s a fun and easy way to get into the water and get some exercise, whether you\'re looking for something relaxing or are looking to take your fitness game up a notch.</p>\r\n<p>Stand Up Paddle is available at most beaches in Dubai, but there are some locations that are particularly good for it. One of these is the beach near Burj Khalifa, which offers great views of the city\'s skyline and plenty of room to practice your skills. If you want to try SUP out with friends, head over to Palm Jumeirah Beach Park or Jumeirah Beach Park 2 for some fun in the sun!</p>', 851, 479, NULL, NULL, 11, NULL, NULL, NULL, 8, NULL, '518,517,', NULL, '150.00', '132.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 12:11:09', '2022-05-26 22:19:41', 1, '[{\"title\":\"One-hour stand-up paddle in Dubai Beach\"},{\"title\":\"Able to swim confidently\"},{\"title\":\"Instructions by Professionals\"}]', '[{\"title\":\"Costumes and Towel\"}]', NULL, NULL, NULL, NULL, '12', NULL, NULL, NULL, NULL, NULL, NULL),
(93, 'Love Boat', 'love-boat', '<p>Make sure to plan ahead for your next vacation. Get up close and personal with the incredible cityscape of Dubai, while enjoying a thrilling ride on the water in a speedboat tour with Love Boats.</p>\r\n<p>Love Boats is one of the most popular tour companies in Dubai, offering sightseeing tours by day or night with experienced captains who will take you across the water at super high speeds. You won&rsquo;t just zoom past the city\'s iconic landmarks, you&rsquo;ll be sure to get a good look at the extraordinary cityscape and admire it from the water. Get your cameras ready to snap some selfies with your friends and family &ndash; or ask the crew members to take photos for you, capturing that perfect moment.</p>', 850, 698, NULL, NULL, 11, 'Dubai Marina Walk Opposite Spinneys Supermarket - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '516,515,', NULL, '120.00', '106.00', 2, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 12:13:59', '2022-05-26 21:30:55', 1, '[{\"title\":\"Love Boat Ride 90 mins \\/ 120 mins (Depends on your Booking)\"},{\"title\":\"Sight Seeing\"},{\"title\":\"Safety Gears\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(94, 'Dubai Parasailing', 'dubai-parasailing', '<p>Parasailing in Dubai is a great way to enjoy the outdoors while taking in some of the most beautiful sights in the area. Whether you\'re looking for something fun to do with friends or want to impress your significant other, parasailing will be sure to give you a memorable experience.</p>\r\n<p>Parasailing is a sport that involves being pulled behind a boat as it travels through the water. The rider sits in a harness that can be attached to the boat by one or two lines depending on what type of activity they are participating in. The rider then experiences lift from an airfoil and can move around freely during their flight.</p>\r\n<p>It\'s an activity for everyone&mdash;even if you\'re not into thrill-seeking sports like skydiving! It\'s also an ideal way for tourists who aren\'t able to explore Dubai by foot or car to see some of its most beautiful sights. If you\'re looking for something fun and unique for your next vacation, look no further than Parasailing in Dubai!</p>', 849, 717, NULL, NULL, 11, 'Dubai International Marine Club - Dubai', NULL, NULL, 8, NULL, '511,512,513,514,', NULL, '382.00', '336.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 12:17:03', '2022-05-26 21:30:22', 1, '[{\"title\":\"100 to 150 meters high ride in air for 7 Minutes\"},{\"title\":\"No previous experience required\"},{\"title\":\"Instructions by Professionals\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(95, 'Jetpack Dubai', 'jetpack-dubai', '<p>Jetpack Dubai will take you on a thrilling ride over the water, showing off the city from an angle that you\'ve never seen before. You\'ll be able to see the skyscrapers and iconic landmarks from a whole new perspective, including Burj Khalifa and Palm Island, as well as many other sites that make Dubai so famous around the world.</p>\r\n<p>Our jetpacks are state-of-the-art, with high-performance engines that let you fly up to 200 meters above ground level and travel at speeds up to 40 km/hour. They\'re also easy to use&mdash;just strap in, push off from a platform, and enjoy! Whether you\'re looking for adventure or just want to see some of Dubai\'s best sights from a different perspective, Jetpack Dubai is sure to have something for everyone.</p>', 848, 677, NULL, NULL, 11, 'Palm Jumeirah - The Palm Jumeirah - Dubai - United Arab Emirates', NULL, NULL, 8, NULL, '510,509,507,508,', NULL, '450.00', '349.00', 1, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 12:19:46', '2022-05-26 21:29:24', 1, '[{\"title\":\"30 minutes Jetpack Ride in Dubai Beach\"},{\"title\":\"Safety Gears\"},{\"title\":\"Should be able to swim or tread water\"},{\"title\":\"Instructions by Professionals\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(96, 'Desert Safari Ras Al Khaimah', 'desert-safari-ras-al-khaimah', '<p>Desert Safari in Ras Al Khaimah is a great way to see the incredible sand dunes, rocky hills and beautiful scenery of the Arabian desert. You can enjoy a fun and exciting day out with family and friends or even just by yourself. The tours offer you a chance to drive through the desert on your own or with other people who are also taking part in the same tour. There are different types of tours available depending on what you want to do during your trip so it is best to check out each one before making your final decision about which one will be best suited for your needs.</p>\r\n<p>Ras Al Khaimah is situated on the southeast coast of the United Arab Emirates (UAE) and is part of the Ras Al Khaimah emirate. It is one of seven emirates that make up this country, which also includes Abu Dhabi, Dubai, Fujairah, Sharjah and Ajman.</p>', 847, 795, NULL, NULL, 11, NULL, NULL, NULL, 8, NULL, '272,271,', NULL, '400.00', '300.00', 6, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 12:23:16', '2022-06-21 12:40:47', 1, '[{\"title\":\"Pick up from your Hotel (If transfer option selected)\"},{\"title\":\"Dune Bashing\"},{\"title\":\"Camel ride\"},{\"title\":\"Sand boarding\"},{\"title\":\"Soft Drinks\"},{\"title\":\"Henna Painting\"},{\"title\":\"Tanoura\"},{\"title\":\"Belly Dance\"},{\"title\":\"BBQ Dinner\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1),
(97, 'Dinner in Desert', 'dinner-in-desert', '<p>Experience the grace and elegance of Ras Al Khaimah in the most comfortable way.</p>\r\n<p>Our Dinner in Desert tour is a classic way to take in the region&rsquo;s dramatic desert scenery, along with some great food and fun-filled activities. Experience a traditional welcome at our desert campsite and then gear up to discover the rich Bedouin culture and heritage. Get your hands adorned with intricate Arabian henna patterns, enjoy falconry, smoke Shisha, and be sure to pose for a great souvenir photograph dressed in traditional Emirati costumes. It&rsquo;s also absolutely worth exploring the spectacular dunes on a camel back.</p>\r\n<p>Moreover, be amazed by mind-boggling Arabian shows like belly dance and Tanura performance, as you savor a lavish buffet dinner comprising tantalizing BBQ specialties. Complimentary refreshments will be served throughout the trip. So don&rsquo;t look further than our Dinner in Desert if you wish to discover the grace and elegance of Ras Al Khaimah in the most comfortable way.</p>', 846, 926, NULL, NULL, 11, 'Al Aweer Desert Camp, Dubai, UAE', NULL, NULL, 8, NULL, '269,268,267,266,', NULL, '1250.00', '1125.00', 6, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 12:26:50', '2022-06-21 11:35:10', 1, '[{\"title\":\"Pick up from your Hotel\"},{\"title\":\"Photographic opportunity with Arabic costumes\"},{\"title\":\"Camel riding\"},{\"title\":\"Unlimited refreshments in camp\"},{\"title\":\"BBQ Dinner with a choice of vegetarian & non vegetarian dishes\"},{\"title\":\"Shisha smoking facility at the shisha corner\"},{\"title\":\"Belly Dance Show with traditional music and Tanura show\"},{\"title\":\"Fire Show\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1),
(98, 'Ras Al Khaimah City Tour', 'ras-al-khaimah-city-tour', '<p>Ras Al Khaimah is one of the seven emirates of the United Arab Emirates. It is located on the north-eastern coast of the UAE and it\'s considered by many to be one of the most beautiful places in the world. Ras Al Khaimah boasts an abundance of year-round sunshine, crystal clear waters and sandy beaches. The city itself is home to a number of attractions including museums, old forts and gardens.</p>\r\n<p>To experience all that Ras Al Khaimah has to offer, why not take a tour? You can choose from a wide range of options ranging from day trips to multi-day excursions. Whether you want to discover ancient history or simply soak up some rays at a resort, there\'s something for everyone!</p>', 845, 728, NULL, NULL, 11, NULL, NULL, NULL, 8, NULL, '265,264,', NULL, '750.00', '750.00', 4, 1, 100, NULL, 'publish', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 12:29:55', '2022-05-26 21:26:03', 1, '[{\"title\":\"Hamra Village\"},{\"title\":\"Al Marjan Island\"},{\"title\":\"Al Dhayah Fort\"},{\"title\":\"Mohammad Bin Salem Mosque\"},{\"title\":\"National Museum\"},{\"title\":\"Old Souk\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(99, 'Marina Bay Sands Sky Park', 'marina-bay-sands-sky-park', '<p>The Marina Bay Sands Skypark is a must-visit for anyone looking to get the best view of Singapore\'s gorgeous skyline.</p>\r\n<p>The Skypark is perched on top of the iconic Marina Bay Sands towers, 57 levels above ground. From this vantage point, you\'ll be able to drink in uninterrupted views of the bustling city below you and watch as tourist attractions like Gardens by the Bay and Supertree Grove stretch out across Singapore Strait.</p>\r\n<p>Take unbeatable souvenir shots at the top of the Marina Bay Sands\' trio of towers, which are sure to impress your family and friends back home! Prepare to be amazed as you watch the sun setting at dusk, painting the clear skies with bright splashes of colors, then stare at the twinkling lights coming from all around you.</p>', NULL, NULL, NULL, NULL, NULL, 'Marina Bay Sands SkyPark Observation Deck: Hotel Tower 3 exterior, 10 Bayfront Avenue, Singapore? 018974', NULL, NULL, 8, NULL, NULL, NULL, '70.00', '67.00', 2, 1, 100, NULL, 'draft', NULL, 1, 1, NULL, NULL, NULL, '2022-05-22 12:33:43', '2022-05-26 22:23:19', 1, '[{\"title\":\"Marina Bay Sands Sky Park Tickets\"}]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
