(14, 'footer_info_text', 'general', '<div class=\"d-md-flex d-lg-block\">\n    <div class=\"mb-5 mr-md-7 mr-lg-0\">\n        <h4 class=\"h6 mb-4 font-weight-bold\">Need My WorldTal Help?</h4>\n        <a href=\"tel:(+84) 666-888-999\">\n            <div class=\"d-flex align-items-center\">\n                <div class=\"mr-4\">\n                    <i class=\"fa fa-phone font-size-50\" aria-hidden=\"true\"></i>\n                </div>\n                <div>\n                    <div class=\"mb-2 h6 font-weight-normal text-gray-1\">Got Questions ? Call us 24/7</div>\n                    <small class=\"d-block font-size-16 font-weight-normal text-primary\">Call Us: <span class=\"text-primary font-weight-semi-bold\">+971 54 786 9294</span></small>\n                </div>\n            </div>\n        </a>\n    </div>\n    <div class=\"ml-md-6 ml-lg-0\">\n        <div class=\"mb-4\">\n            <h4 class=\"h6 font-weight-bold mb-2 font-size-17\">Contact Info</h4>\n            <address class=\"pr-4\">\n                    <span class=\"mb-2 h6 font-weight-normal text-gray-1\">\n                        Address Goes here\n                    </span>\n            </address>\n        </div>\n        <ul class=\"list-inline mb-0\">\n            <li class=\"list-inline-item mr-2\">\n                <a class=\"btn btn-icon btn-social btn-bg-transparent\" href=\"https://www.facebook.com/worldtaltours\">\n                    <span class=\"fa fa-facebook-f btn-icon__inner\"></span>\n                </a>\n            </li>\n            <!--<li class=\"list-inline-item mr-2\">\n                <a class=\"btn btn-icon btn-social btn-bg-transparent\" href=\"#\">\n                    <span class=\"fa fa-twitter  btn-icon__inner\"></span>\n                </a>\n            </li>-->\n            <li class=\"list-inline-item mr-2\">\n                <a class=\"btn btn-icon btn-social btn-bg-transparent\" href=\"https://www.instagram.com/worldtal22/\">\n                    <span class=\"fa fa-instagram btn-icon__inner\"></span>\n                </a>\n            </li>\n            <!--<li class=\"list-inline-item mr-2\">\n                <a class=\"btn btn-icon btn-social btn-bg-transparent\" href=\"#\">\n                    <span class=\"fa fa-linkedin btn-icon__inner\"></span>\n                </a>\n            </li>-->\n        </ul>\n    </div>\n</div>', NULL, 1, 1, NULL, NULL, '2022-06-14 04:52:14'),
